    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "\u65b0\u3057\u3044\u30b5\u30fc\u30d3\u30b9\u30c8\u30f3\u30cd\u30eb\u304c\u4f5c\u6210\u3055\u308c\u308b\u304b\u3001\u30b5\u30fc\u30d3\u30b9\u304c\u521d\u3081\u3066\u5b9f\u884c\u3055\u308c\u308b\u3068\uff08\u30c7\u30d5\u30a9\u30eb\u30c8\u306e\u30b8\u30a7\u30c3\u30c6\u30a3\u30fb\u30a6\u30a7\u30d6\u30b5\u30fc\u30d0\u30fc\u3084\u30d7\u30e9\u30b0\u30a4\u30f3\u306a\u3069\uff09\u3001\u30a2\u30c9\u30ec\u30b9\u306e\u6240\u6709\u6a29\u3092\u5b9f\u8cea\u7684\u306b\u5236\u5fa1\u3059\u308b\u79d8\u5bc6\u6697\u53f7\u9375\u304c\u4f5c\u6210\u3055\u308c\u307e\u3059\u3002\u3053\u308c\u306f\u901a\u5e38\u3001<code>&hellip;privKey.dat</code>\u307e\u305f\u306f<code>eepPriv.dat</code>\u3068\u3044\u3046\u540d\u524d\u304c\u4ed8\u3051\u3089\u308c\u307e\u3059\u304c\u3001\u6240\u5c5e\u3059\u308b\u30b5\u30fc\u30d3\u30b9\u3092\u793a\u3059\u305f\u3081\u306b\u540d\u524d\u3092\u5909\u66f4\u3057\u3001\u30c8\u30f3\u30cd\u30eb\u30de\u30cd\u30fc\u30b8\u30e3\u30fc\u306e\u30b5\u30fc\u30d0\u30fc\u8a2d\u5b9a\u3067\u518d\u6307\u5b9a\u3059\u308b\u3053\u3068\u3092\u304a\u3059\u3059\u3081\u3057\u307e\u3059\u3002\u3053\u306e.dat\u30d5\u30a1\u30a4\u30eb\u3092\u5b89\u5168\u306b\u30d0\u30c3\u30af\u30a2\u30c3\u30d7\u3059\u308b\u5fc5\u8981\u304c\u3042\u308a\u307e\u3059\u3002\u5931\u304f\u3059\u3068\u3001\u30db\u30b9\u30c8\u540d\u306e\u6240\u6709\u6a29\u3068\u5236\u5fa1\u6a29\u3092\u5931\u3044\u307e\u3059\uff01";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "\u3053\u306e\u8a2d\u5b9a\u306f\u3001\u30c8\u30ec\u30f3\u30c8\u3092\u30c0\u30a6\u30f3\u30ed\u30fc\u30c9\u307e\u305f\u306f\u4f5c\u6210\u3059\u308b\u969b\u306bI2PSnark\u304c\u8a31\u53ef\u3059\u308b\u6700\u5927\u30d5\u30a1\u30a4\u30eb\u6570\u306e\u69cb\u6210\u3092\u53ef\u80fd\u306b\u3057\u307e\u3059\u3002\u30c7\u30d5\u30a9\u30eb\u30c8\u306e2000\u30d5\u30a1\u30a4\u30eb\u304b\u3089\u3053\u306e\u5024\u3092\u5927\u5e45\u306b\u5897\u3084\u3059\u5834\u5408\u3001\u30db\u30b9\u30c8\u30b7\u30b9\u30c6\u30e0\u306e\u8ffd\u52a0\u306e\u8a2d\u5b9a\u304c\u5fc5\u8981\u306b\u306a\u308b\u5834\u5408\u304c\u3042\u308a\u307e\u3059\u3002\u30aa\u30da\u30ec\u30fc\u30c6\u30a3\u30f3\u30b0\u30b7\u30b9\u30c6\u30e0\u304c\u8a31\u53ef\u3059\u308b\u30aa\u30fc\u30d7\u30f3\u30d5\u30a1\u30a4\u30eb\u306e\u6700\u5927\u6570\u3092\u5897\u3084\u3059\u305f\u3081\u306b\u3001\u4f8b\u3048\u3070Linux\u306e\u5834\u5408\u306f<code>ulimit -n</code>\u3092\u8ffd\u52a0\u8a2d\u5b9a\u3059\u308b\u5fc5\u8981\u304c\u3042\u308a\u307e\u3059\u3002\u5909\u66f4\u3059\u308b\u306b\u306f\u3001I2PSnark\u306e\u8a2d\u5b9a\u30d5\u30a1\u30a4\u30eb<code>i2psnark.config</code>\u306b\u8ffd\u52a0\u3057\u307e\u3059\u3002[I2PSnark\u307e\u305f\u306f\u30eb\u30fc\u30bf\u30fc\u306e\u518d\u8d77\u52d5\u304c\u5fc5\u8981\u3067\u3059]";
