    t[616] = "Bonuses may be positive or negative, and affect the peer's inclusion in Fast and High Capacity tiers. Fast peers are used for client tunnels, and High Capacity peers are used for some exploratory tunnels.";
    t[617] = "\u30dc\u30fc\u30ca\u30b9\u306f\u30d7\u30e9\u30b9\u307e\u305f\u306f\u30de\u30a4\u30ca\u30b9\u3067\u3042\u308a\u3001\u9ad8\u901f\u304a\u3088\u3073\u5927\u5bb9\u91cf\u306e\u5c64\u3078\u306e\u30d4\u30a2\u306e\u542b\u6709\u306b\u5f71\u97ff\u3092\u4e0e\u3048\u308b\u53ef\u80fd\u6027\u304c\u3042\u308a\u307e\u3059\u3002 \u9ad8\u901f\u30d4\u30a2\u306f\u30af\u30e9\u30a4\u30a2\u30f3\u30c8\u30c8\u30f3\u30cd\u30eb\u306b\u4f7f\u7528\u3055\u308c\u3001\u3044\u304f\u3064\u304b\u306e\u63a2\u7d22\u7684\u30c8\u30f3\u30cd\u30eb\u306b\u306f\u5927\u5bb9\u91cf\u306e\u30d4\u30a2\u304c\u4f7f\u7528\u3055\u308c\u307e\u3059\u3002";
    t[618] = "Yes";
    t[619] = "\u306f\u3044";
    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "I2P \u306f\u3053\u306e\u69cb\u6210\u3067\u3082\u554f\u984c\u306a\u304f\u52d5\u4f5c\u3057\u307e\u3059\u304c\u3001\u5b9f\u969b\u306b 128KBps \u3092\u8d85\u3048\u308b\u5e2f\u57df\u5e45\u3092\u5171\u6709\u3067\u304d\u308b\u5834\u5408\u306f\u3001\u30d5\u30a1\u30a4\u30a2\u30a6\u30a9\u30fc\u30eb\u3092\u958b\u3044\u305f\u65b9\u304c\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u306b\u3068\u3063\u3066\u306f\u308b\u304b\u306b\u5f79\u7acb\u3061\u307e\u3059\u3002";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "I2P\u3067\u63d0\u4f9b\u3055\u308c\u308b\u30b3\u30de\u30f3\u30c9\u30e9\u30a4\u30f3\u30a2\u30d7\u30ea\u30b1\u30fc\u30b7\u30e7\u30f3\u3067\u3042\u308a\u3001URL\u30ea\u30bd\u30fc\u30b9\u306e\u30ea\u30af\u30a8\u30b9\u30c8\u306b\u4f7f\u7528\u3055\u308c\u307e\u3059\u3002 <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a>\u3084<a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>\u306b\u4f3c\u305f\u3082\u306e\u3067\u3059\u3002 Eepget\u306f\u30eb\u30fc\u30bf\u30fc\u5185\u90e8\u3067\u3082\u4f7f\u7528\u3055\u308c\u3001\u4f8b\u3048\u3070\u30ea\u30e2\u30fc\u30c8\u30db\u30b9\u30c8\u304b\u3089\u306e\u30ea\u30b7\u30fc\u30c9\u306b\u4f7f\u7528\u3055\u308c\u307e\u3059\u3002\u30c7\u30d5\u30a9\u30eb\u30c8\u3067\u306f\u3001eepget\u306f<code>127.0.0.1:4444</code>\u306eHTTP\u30d7\u30ed\u30ad\u30b7\u3092\u4f7f\u7528\u3057\u307e\u3059\u3002";
    t[630] = "Mobile console option saved.";
