    t[711] = "\u5927\u6587\u5b57";
    t[714] = "Backup quantity";
    t[715] = "\u30d0\u30c3\u30af\u30a2\u30c3\u30d7\u91cf";
    t[720] = "Textual router performance statistics";
    t[721] = "\u30c6\u30ad\u30b9\u30c8\u306e\u30eb\u30fc\u30bf\u30fc\u30d1\u30d5\u30a9\u30fc\u30de\u30f3\u30b9\u7d71\u8a08";
    t[722] = "Javadocs";
    t[723] = "Javadoc";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "\u30a4\u30fc\u30d7\u30b5\u30a4\u30c8\u3068\u306f\u3001I2P\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u4e0a\u3067\u533f\u540d\u3067\u30db\u30b9\u30c8\u3055\u308c\u308b\u30a6\u30a7\u30d6\u30b5\u30a4\u30c8\u3067\u3059\u3002\u30a6\u30a7\u30d6\u30d6\u30e9\u30a6\u30b6\u3092I2P\u306eHTTP\u30d7\u30ed\u30ad\u30b7\u3092\u4f7f\u3046\u3088\u3046\u306b\u8a2d\u5b9a\u3057\uff08\u4e0a\u8a18\u53c2\u7167\uff09\u3001<code>.i2p</code>\u3067\u7d42\u308f\u308b\u30a6\u30a7\u30d6\u30b5\u30a4\u30c8\uff08\u4f8b\uff1a<a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>\uff09\u306b\u30a2\u30af\u30bb\u30b9\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u307e\u305f\u3001\u30d7\u30ed\u30ad\u30b7\u3092\u4f7f\u7528\u3059\u308b\u969b\u306bDNS\u30ea\u30fc\u30af\u3092\u9632\u3050\u305f\u3081\u306b\u3001\u30d6\u30e9\u30a6\u30b6\u306e\u8a2d\u5b9a\u3067\u30ea\u30e2\u30fc\u30c8\u3067DNS\u3092\u89e3\u6c7a\u3059\u308b\u3088\u3046\u306b\u3082\u3057\u3066\u304f\u3060\u3055\u3044\u3002";
    t[730] = "Updating UDP port to {0}";
    t[731] = "UDP \u30dd\u30fc\u30c8\u3092 {0} \u306b\u66f4\u65b0\u4e2d";
    t[732] = "Apache Web Server Security Guide";
    t[733] = "Apache Web\u30b5\u30fc\u30d0\u30fc\u306e\u30bb\u30ad\u30e5\u30ea\u30c6\u30a3\u30ac\u30a4\u30c9";
    t[736] = "Locate the configuration file: <code>00-net.i2p.router.web.RouterConsoleRunner-clients.config</code> in the <code>clients.config.d</code> folder in your I2P settings directory, and then edit accordingly:";
    t[737] = "I2P\u8a2d\u5b9a\u30c7\u30a3\u30ec\u30af\u30c8\u30ea\u306e<code>clients.config.d</code>\u30d5\u30a9\u30eb\u30c0\u5185\u306e<code>00-net.i2p.router.web.RouterConsoleRunner-clients.config</code>\u69cb\u6210\u30d5\u30a1\u30a4\u30eb\u3092\u898b\u3064\u3051\u3001\u305d\u308c\u306b\u5f93\u3063\u3066\u7de8\u96c6\u3057\u3066\u304f\u3060\u3055\u3044\uff1a";
    t[738] = "Webmail client";
    t[739] = "Web\u30e1\u30fc\u30eb\u30af\u30e9\u30a4\u30a2\u30f3\u30c8";
    t[756] = "Lookup Password";
    t[757] = "\u30d1\u30b9\u30ef\u30fc\u30c9\u3092\u8abf\u3079\u308b";
    t[762] = "Rekeying after graceful shutdown";
    t[763] = "\u6b63\u5e38\u306a\u30b7\u30e3\u30c3\u30c8\u30c0\u30a6\u30f3\u5f8c\u306b\u30ad\u30fc\u4ea4\u63db";
    t[770] = "WorldAtlas";
    t[771] = "\u30ef\u30fc\u30eb\u30c9\u30a2\u30c8\u30e9\u30b9";
    t[772] = "If you can't, I2P supports UPnP (Universal Plug and Play) and UDP hole punching with \"SSU introductions\" to relay traffic.";
