    t[2211] = "I2P\u306f\u3001\u30d7\u30ed\u30b0\u30e9\u30e0\u304c\u521d\u3081\u3066\u5b9f\u884c\u3055\u308c\u308b\u304b\u3001<a href=/confignet#ipchange>Laptop\u30e2\u30fc\u30c9</a>\u3067\u5b9f\u884c\u3055\u308c\u3066\u3044\u308b\u3068\u304d\u306b\u5916\u90e8IP\u30a2\u30c9\u30ec\u30b9\u304c\u5909\u66f4\u3055\u308c\u308b\u5834\u5408\u30019000\u304b\u308931000\u306e\u9593\u306e\u30e9\u30f3\u30c0\u30e0\u306a\u30dd\u30fc\u30c8\u3092\u4ed6\u306e\u30eb\u30fc\u30bf\u30fc\u3068\u901a\u4fe1\u3059\u308b\u305f\u3081\u306b\u9078\u629e\u3057\u307e\u3059\u3002 <a href=/confignet#udpconfig>\u9078\u629e\u3055\u308c\u305f\u30dd\u30fc\u30c8</a>\u306f<a href=/confignet>\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u69cb\u6210\u30da\u30fc\u30b8</a>\u306b\u8868\u793a\u3055\u308c\u307e\u3059\u3002";
