    t[2579] = "\u30b5\u30a4\u30c9\u30d0\u30fc\u306e\u591a\u304f\u306e\u7d71\u8a08\u60c5\u5831\u306f\u3001\u8ffd\u52a0\u306e\u5206\u6790\u306e\u305f\u3081\u306b<a href='/configstats'>\u8a2d\u5b9a</a>\u3057\u3066<a href='/graphs'>\u30b0\u30e9\u30d5\u5316</a>\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u30b5\u30a4\u30c9\u30d0\u30fc\u306b\u8868\u793a\u3055\u308c\u308b\u30bb\u30af\u30b7\u30e7\u30f3\u3068\u3001\u305d\u308c\u3089\u306e\u914d\u7f6e\u3082<a href='/configsidebar'>\u30b5\u30a4\u30c9\u30d0\u30fc\u30b3\u30f3\u30d5\u30a3\u30b0\u30ec\u30fc\u30b7\u30e7\u30f3\u30da\u30fc\u30b8</a>\u3067\u30ab\u30b9\u30bf\u30de\u30a4\u30ba\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "\u3053\u306e\u30c8\u30f3\u30cd\u30eb\u56fa\u6709\u306e\u8a2d\u5b9a\u3067\u306f\u3001\u30eb\u30fc\u30bf\u30fc\u306b\u30db\u30b9\u30c8\u3055\u308c\u308b\u30b5\u30fc\u30d0\u30fc\u3078\u306eping\u3078\u306e\u8fd4\u4fe1\u3092\u6709\u52b9\u5316\u307e\u305f\u306f\u7121\u52b9\u5316\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u30d4\u30f3\u306e\u7121\u52b9\u5316\u306b\u306f\u3001Tunnel Manager\u306e\u30b5\u30fc\u30d0\u30fc\u306e\u8a2d\u5b9a\u306e<i>Custom Options</i>\u30bb\u30af\u30b7\u30e7\u30f3\u306b<code>i2p.streaming.answerPings=false</code>\u306e\u884c\u3092\u8ffd\u52a0\u3059\u308b\u5fc5\u8981\u304c\u3042\u308a\u307e\u3059\u3002";
    t[2592] = "Max";
    t[2593] = "\u6700\u5927";
    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "\u7f72\u540d\u3055\u308c\u3066\u3044\u306a\u3044(.zip) I2P\u30a2\u30c3\u30d7\u30c7\u30fc\u30c8\u3092\u30a4\u30f3\u30b9\u30c8\u30fc\u30eb\u3059\u308b\u5834\u5408\u3001<code>router.config</code> \u30d5\u30a1\u30a4\u30eb\u306b\u3053\u308c\u3092\u8ffd\u52a0\u3059\u308b\u5fc5\u8981\u304c\u3042\u308a\u307e\u3059\u3002\u305f\u3060\u3057\u3001\u3059\u3067\u306b<code>routerconsole.advanced=true</code>\u3092\u8a2d\u5b9a\u3057\u3066\u3044\u308b\u5834\u5408\u306f\u3001\u3053\u306e\u30aa\u30d7\u30b7\u30e7\u30f3\u306f\u65e2\u306b\u63d0\u4f9b\u3055\u308c\u3066\u3044\u307e\u3059\u3002\u6ce8\u610f\uff1aI2P+ 0.9.48+\u4ee5\u964d\u3001<a href=/configupdate#i2pupdates>\u7f72\u540d\u3055\u308c\u3066\u3044\u306a\u3044\u30a2\u30c3\u30d7\u30c7\u30fc\u30c8</a>\u306e\u30a4\u30f3\u30b9\u30c8\u30fc\u30eb\u306f\u30c7\u30d5\u30a9\u30eb\u30c8\u3067\u6709\u52b9\u306b\u306a\u3063\u3066\u3044\u307e\u3059\u3002";
