    t[2617] = "I2P\u3092\u5b9f\u884c\u3057\u3066\u3044\u308b\u4eba\u7269\u3092\u77e5\u3063\u3066\u3044\u3066\u4fe1\u983c\u3057\u3066\u3044\u308b\u5834\u5408\u3001\u305d\u306e\u4eba\u306b\u3001\u30eb\u30fc\u30bf\u30fc\u30b3\u30f3\u30bd\u30fc\u30eb\u3067\u3053\u306e\u30da\u30fc\u30b8\u3092\u4f7f\u7528\u3057\u3066\u751f\u6210\u3055\u308c\u305f\u30ea\u30b7\u30fc\u30c9\u30d5\u30a1\u30a4\u30eb\u3092\u9001\u4fe1\u3059\u308b\u3088\u3046\u306b\u4f9d\u983c\u3057\u3066\u304f\u3060\u3055\u3044\u3002\u305d\u306e\u5f8c\u3001\u53d7\u3051\u53d6\u3063\u305f\u30d5\u30a1\u30a4\u30eb\u3092\u4f7f\u7528\u3057\u3066\u3001{0}\u3067<i>Reseed from file</i>\u30aa\u30d7\u30b7\u30e7\u30f3\u3092\u9078\u629e\u3057\u307e\u3059\u3002";
    t[2620] = "To enable session-only changes to the client tunnels, activate the console's <a href=\"/help/advancedsettings\">Advanced mode</a>.";
