    t[2680] = "Review possible sybils in network database";
    t[2681] = "\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u30c7\u30fc\u30bf\u30d9\u30fc\u30b9\u5185\u306e\u53ef\u80fd\u306a\u30b7\u30d3\u30eb\u3092\u78ba\u8a8d\u3059\u308b";
    t[2682] = "WAN Ethernet Link Configuration";
    t[2683] = "WAN \u30a4\u30fc\u30b5\u30cd\u30c3\u30c8\u30ea\u30f3\u30af\u8a2d\u5b9a";
    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "\u3053\u306e\u8a2d\u5b9a\uff08\u79d2\u5358\u4f4d\uff09\u3067\u306f\u3001Peer Exploration Job\u306e\u5b9f\u884c\u9593\u9694\u3092\u30aa\u30fc\u30d0\u30fc\u30e9\u30a4\u30c9\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u3053\u306e\u30b8\u30e7\u30d6\u306f\u65b0\u3057\u3044\u30d4\u30a2\u3092NetDb\u306b\u8ffd\u52a0\u3059\u308b\u305f\u3081\u306b\u5b9f\u884c\u3055\u308c\u3001\u30c7\u30d5\u30a9\u30eb\u30c8\u3067\u306f80\u79d2\u3054\u3068\u306b\u5b9f\u884c\u3055\u308c\u307e\u3059\u3002\u307e\u305f\u3001\u30eb\u30fc\u30bf\u30fc\u306e\u30b8\u30e7\u30d6\u3084\u30e1\u30c3\u30bb\u30fc\u30b8\u306e\u9045\u5ef6\u304c\u767a\u751f\u3057\u3066\u3044\u308b\u5834\u5408\u306f\u30013\u5206\u3054\u3068\u306b\u5b9f\u884c\u3055\u308c\u307e\u3059\u3002NetDb\u306e\u30b5\u30a4\u30ba\u304c4000\u306e\u30d4\u30a2\u306b\u9054\u3057\u305f\u5834\u5408\u3001\u4e00\u6642\u505c\u6b62\u6642\u9593\u306f15\u5206\u306b\u5897\u52a0\u3057\u307e\u3059\u3002NetDb\u304c\u5145\u5b9f\u3057\u3066\u3044\u308b\u72b6\u614b\uff082000\u4ee5\u4e0a\u306e\u30d4\u30a2\uff09\u3067\u3042\u308b\u5834\u5408\u3084\u3001\u5168\u4f53\u7684\u306a\u5e2f\u57df\u5e45\u4f7f\u7528\u91cf\u3092\u6e1b\u3089\u3057\u305f\u3044\u5834\u5408\u306f\u3001\u9045\u5ef6\u6642\u9593\u3092\u5897\u3084\u3059\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u6ce8\u610f\uff1aFloodfill\u30eb\u30fc\u30bf\u30fc\u3067\u306f\u3001\u3053\u306e\u30b8\u30e7\u30d6\u306f\u5b9f\u884c\u3055\u308c\u307e\u305b\u3093\u3002";
    t[2698] = "Current";
    t[2699] = "\u73fe\u5728";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "I2P\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u4e0a\u3067\u30db\u30b9\u30c8\u3055\u308c\u308b\u30a6\u30a7\u30d6\u30b5\u30a4\u30c8\u3067\u3059\u3002\u30c7\u30d5\u30a9\u30eb\u30c8\u3067\u306f\u3001<a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty\u30a6\u30a7\u30d6\u30b5\u30fc\u30d0\u30fc</a>\u304c<a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>\u3067\u8a2d\u5b9a\u304a\u3088\u3073\u5b9f\u884c\u3055\u308c\u307e\u3059\u3002";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "<a href=/i2ptunnelmgr>\u30c8\u30f3\u30cd\u30eb\u30de\u30cd\u30fc\u30b8\u30e3</a>\u3067\u7121\u52b9\u306b\u3057\u305f\u308a\u5909\u66f4\u3057\u305f\u308a\u3067\u304d\u307e\u3059\u3002\u7279\u5b9a\u306e\u30a4\u30f3\u30bf\u30fc\u30d5\u30a7\u30fc\u30b9\u307e\u305f\u306f\u3059\u3079\u3066\u306e\u30a4\u30f3\u30bf\u30fc\u30d5\u30a7\u30fc\u30b9\u306b\u30d0\u30a4\u30f3\u30c9\u3059\u308b\u3088\u3046\u306b\u3082\u8a2d\u5b9a\u3067\u304d\u307e\u3059\u3002";
    t[2728] = "I2P+ Service now enabled on system start";
    t[2729] = "\u30b7\u30b9\u30c6\u30e0\u8d77\u52d5\u6642\u306b I2P \u30b5\u30fc\u30d3\u30b9\u304c\u6709\u52b9\u306b\u306a\u308a\u307e\u3057\u305f";
    t[2748] = "Computer related news aggregation";
    t[2749] = "\u30b3\u30f3\u30d4\u30e5\u30fc\u30bf\u30fc\u95a2\u9023\u306e\u30cb\u30e5\u30fc\u30b9\u96c6\u7d04";
    t[2752] = "Same IP as us";
