    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+\u306f\u3001<a href=/config>\u5e2f\u57df\u5e45\u306e\u8a2d\u5b9a\u30bb\u30af\u30b7\u30e7\u30f3</a>\u3067\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u63a5\u7d9a\u306e\u901f\u5ea6\u3092\u6b63\u78ba\u306b\u53cd\u6620\u3067\u304d\u308b\u5834\u5408\u306b\u6700\u9069\u306b\u6a5f\u80fd\u3057\u307e\u3059\u3002\u30c7\u30d5\u30a9\u30eb\u30c8\u3067\u306f\u3001I2P+\u306f\u591a\u304f\u306e\u30e6\u30fc\u30b9\u30b1\u30fc\u30b9\u306b\u9069\u3055\u306a\u3044\u304b\u306a\u308a\u4fdd\u5b88\u7684\u306a\u5024\u3067\u69cb\u6210\u3055\u308c\u3066\u3044\u307e\u3059\u306e\u3067\u3001\u3053\u308c\u3089\u306e\u8a2d\u5b9a\u3092\u78ba\u8a8d\u3057\u3001\u5fc5\u8981\u306b\u5fdc\u3058\u3066\u4fee\u6b63\u3057\u3066\u304f\u3060\u3055\u3044\u3002\u5272\u308a\u5f53\u3066\u308b\u5e2f\u57df\u5e45\u304c\u591a\u3051\u308c\u3070\u591a\u3044\u307b\u3069\u3001\u7279\u306b\u4e0a\u308a\u5e2f\u57df\u5e45\u304c\u591a\u3051\u308c\u3070\u591a\u3044\u307b\u3069\u3001\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u304b\u3089\u306e\u6069\u6075\u3092\u3088\u308a\u591a\u304f\u53d7\u3051\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002";
