    t[2864] = "pixels wide";
    t[2865] = "\u30d4\u30af\u30bb\u30eb\u5e45";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "I2P\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u30d7\u30ed\u30c8\u30b3\u30eb\uff08I2NP\uff09\u306f\u3001\u30eb\u30fc\u30bf\u30fc\u9593\u306e\u30e1\u30c3\u30bb\u30fc\u30b8\u306e\u30eb\u30fc\u30c6\u30a3\u30f3\u30b0\u3068\u30df\u30ad\u30b7\u30f3\u30b0\u3092\u7ba1\u7406\u3057\u307e\u3059\u3002\u307e\u305f\u3001\u30d4\u30a2\u3068\u901a\u4fe1\u3059\u308b\u969b\u306e\u30c8\u30e9\u30f3\u30b9\u30dd\u30fc\u30c8\u306e\u9078\u629e\uff08\u8907\u6570\u306e\u5834\u5408\uff09\u3082\u884c\u3044\u307e\u3059\u3002\u8a73\u7d30\u306b\u3064\u3044\u3066\u306f\u3001<a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>\u30aa\u30f3\u30e9\u30a4\u30f3\u30c9\u30ad\u30e5\u30e1\u30f3\u30c8</a>\u3092\u53c2\u7167\u3057\u3066\u304f\u3060\u3055\u3044\u3002";
    t[2884] = "Expired {0} ago";
    t[2885] = "{0} \u524d\u306b\u671f\u9650\u5207\u308c";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "\u4ed6\u306e\u30eb\u30fc\u30bf\u30fc\u304b\u3089\u306e\u30ea\u30af\u30a8\u30b9\u30c8\u3092\u53d7\u3051\u5165\u308c\u308b\u304b\u62d2\u5426\u3059\u308b\u305f\u3081\u306e\u3042\u306a\u305f\u306e\u30eb\u30fc\u30bf\u30fc\u306e\u30b9\u30c6\u30fc\u30bf\u30b9\u3067\u3059\u3002\u3042\u306a\u305f\u306e\u30eb\u30fc\u30bf\u30fc\u306f\u3001\u3059\u3079\u3066\u306e\u30ea\u30af\u30a8\u30b9\u30c8\u3092\u53d7\u3051\u5165\u308c\u308b\u304b\u3001\u4e00\u90e8\u306e\u30ea\u30af\u30a8\u30b9\u30c8\u3092\u53d7\u3051\u5165\u308c\u308b\u304b\u62d2\u5426\u3059\u308b\u304b\u3001\u3042\u308b\u3044\u306f\u3055\u307e\u3056\u307e\u306a\u7406\u7531\u3067\u3059\u3079\u3066\u306e\u30ea\u30af\u30a8\u30b9\u30c8\u3092\u62d2\u5426\u3059\u308b\u3053\u3068\u304c\u3042\u308a\u307e\u3059\u3002\u3053\u308c\u306b\u3088\u308a\u3001\u5e2f\u57df\u5e45\u3068CPU\u306e\u8981\u6c42\u3092\u5236\u5fa1\u3057\u3001\u30ed\u30fc\u30ab\u30eb\u30af\u30e9\u30a4\u30a2\u30f3\u30c8\u306e\u305f\u3081\u306e\u5bb9\u91cf\u3092\u7dad\u6301\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002 <b>\u30e1\u30e2";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "\u7a3c\u50cd\u3057\u3066\u3044\u308bI2P\u30eb\u30fc\u30bf\u30fc\u3092\u6301\u3064\u4fe1\u983c\u3067\u304d\u308b\u53cb\u4eba\u306b\u9023\u7d61\u3057\u3001I2P\u30eb\u30fc\u30bf\u30fc\u306e\u518d\u30b7\u30fc\u30c9\u306e\u30b5\u30dd\u30fc\u30c8\u3092\u304a\u9858\u3044\u3057\u3066\u304f\u3060\u3055\u3044\u3002\u5f7c\u3089\u306b\u5f7c\u3089\u306e\u7a3c\u50cd\u4e2d\u306eI2P\u30eb\u30fc\u30bf\u30fc\u304b\u3089\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u3057\u305f\u30ea\u30b7\u30fc\u30c9\u30d5\u30a1\u30a4\u30eb\u3092\u9001\u3063\u3066\u3082\u3089\u3046\u3088\u3046\u306b\u304a\u9858\u3044\u3057\u3066\u304f\u3060\u3055\u3044\u3002\u30d5\u30a1\u30a4\u30eb\u306e\u3084\u308a\u53d6\u308a\u306f\u5b89\u5168\u306a\u30c1\u30e3\u30cd\u30eb\u3067\u884c\u308f\u308c\u308b\u3053\u3068\u304c\u91cd\u8981\u3067\u3042\u308a\u3001\u5916\u90e8\u304b\u3089\u306e\u6539\u7ac4\u3092\u907f\u3051\u308b\u305f\u3081\u306b\uff08PGP\u3067\u7f72\u540d\u3001\u6697\u53f7\u5316\u3055\u308c\u3001\u4fe1\u983c\u3067\u304d\u308b\u516c\u958b\u9375\u3067\u691c\u8a3c\u3055\u308c\u3066\u3044\u308b\u306a\u3069\uff09\u6697\u53f7\u5316\u3055\u308c\u308b\u3079\u304d\u3067\u3059\u3002\u30d5\u30a1\u30a4\u30eb\u81ea\u4f53\u306b\u306f\u7f72\u540d\u304c\u306a\u3044\u305f\u3081\u3001\u4fe1\u983c\u3067\u304d\u308b\u53cb\u4eba\u304b\u3089\u306e\u30d5\u30a1\u30a4\u30eb\u3060\u3051\u3092\u53d7\u3051\u5165\u308c\u3066\u304f\u3060\u3055\u3044\u3002\u30bd\u30fc\u30b9\u3092\u78ba\u8a8d\u3067\u304d\u306a\u3044\u5834\u5408\u306f\u3001\u30ea\u30b7\u30fc\u30c9\u30d5\u30a1\u30a4\u30eb\u3092\u30a4\u30f3\u30dd\u30fc\u30c8\u3057\u306a\u3044\u3067\u304f\u3060\u3055\u3044\u3002";
    t[2916] = "Last Good Send";
    t[2917] = "\u6700\u7d42\u826f\u597d\u9001\u4fe1";
    t[2918] = "Delete this value to disable";
    t[2919] = "\u7121\u52b9\u306b\u3059\u308b\u306b\u306f\u3053\u306e\u5024\u3092\u524a\u9664\u3057\u307e\u3059";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "\u4ed6\u306e\u30c8\u30f3\u30cd\u30eb\u3001\u307e\u305f\u306f\u8907\u6570\u306e\u30c8\u30f3\u30cd\u30eb\u3067\u4f7f\u7528\u3067\u304d\u308b\u30d5\u30a1\u30a4\u30eb\u306b\u8a18\u9332\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u308b\u30011\u3064\u306e\u30c8\u30f3\u30cd\u30eb\u3067\u30d5\u30a1\u30a4\u30eb\u306b\u66f8\u304d\u8fbc\u3080\u30ec\u30b3\u30fc\u30c0\u30fc\u3092\u4f7f\u7528\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u3053\u308c\u3089\u306e\u30d5\u30a1\u30a4\u30eb\u306f\u624b\u52d5\u3067\u7de8\u96c6\u3059\u308b\u3053\u3068\u3082\u3067\u304d\u307e\u3059\u3002";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
    t[2925] = "Java BigInteger \u30e9\u30a4\u30d6\u30e9\u30ea\u306e\u975e\u30cd\u30a4\u30c6\u30a3\u30d6\u306e\u30bd\u30d5\u30c8\u30a6\u30a7\u30a2 \u30a8\u30df\u30e5\u30ec\u30fc\u30c8 \u30d0\u30fc\u30b8\u30e7\u30f3\u3092\u5b9f\u884c\u3059\u308b\u30eb\u30fc\u30bf\u30fc";
    t[2928] = "Country";
    t[2929] = "\u56fd";
    t[2934] = "Peer's clockskew relative to our clock";
    t[2935] = "\u79c1\u305f\u3061\u306e\u6642\u8a08\u306b\u6bd4\u3079\u3066\u30d4\u30a2\u306e\u6642\u8a08\u304c\u304b\u304b\u308a\u307e\u3059";
    t[2936] = "A threshold that if breached will cause the offending remote destination to be recorded in a specified file";
    t[2937] = "\u3057\u304d\u3044\u5024\u306b\u9055\u53cd\u3059\u308b\u3068\u3001\u554f\u984c\u306e\u3042\u308b\u30ea\u30e2\u30fc\u30c8\u63a5\u7d9a\u5148\u304c\u6307\u5b9a\u3055\u308c\u305f\u30d5\u30a1\u30a4\u30eb\u306b\u8a18\u9332\u3055\u308c\u307e\u3059\u3002";
    t[2938] = "This is usually due to a port 7654 conflict. Check the logs to verify.";
    t[2939] = "\u3053\u308c\u306f\u901a\u5e38\u3001\u30dd\u30fc\u30c8 7654 \u306e\u7af6\u5408\u304c\u539f\u56e0\u3067\u3059\u3002";
    t[2940] = "Disabling inbound TCP";
    t[2941] = "\u7740\u4fe1 TCP \u3092\u7121\u52b9\u5316\u4e2d";
    t[2944] = "Keyring";
    t[2945] = "\u30ad\u30fc\u30ea\u30f3\u30b0";
    t[2946] = "Verified family (signing certificate is installed and valid)";
    t[2947] = "\u691c\u8a3c\u6e08\u307f\u30d5\u30a1\u30df\u30ea\u30fc (\u7f72\u540d\u8a3c\u660e\u66f8\u304c\u30a4\u30f3\u30b9\u30c8\u30fc\u30eb\u3055\u308c\u3066\u304a\u308a\u3001\u6709\u52b9\u3067\u3059)";
    t[2954] = "Router info not available";
    t[2955] = "\u30eb\u30fc\u30bf\u30fc\u60c5\u5831\u304c\u5229\u7528\u3067\u304d\u307e\u305b\u3093";
    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "\u4ee5\u4e0b\u306b\u30ea\u30b9\u30c8\u3055\u308c\u3066\u3044\u308bJava Web\u30a2\u30d7\u30ea\u30b1\u30fc\u30b7\u30e7\u30f3\u306f\u3001WebConsole\u30af\u30e9\u30a4\u30a2\u30f3\u30c8\u306b\u3088\u3063\u3066\u958b\u59cb\u3055\u308c\u3001\u30eb\u30fc\u30bf\u30fc\u3068\u540c\u3058JVM\u3067\u5b9f\u884c\u3055\u308c\u307e\u3059\u3002 \u901a\u5e38\u3001\u30eb\u30fc\u30bf\u30fc\u30b3\u30f3\u30bd\u30fc\u30eb\u304b\u3089\u30a2\u30af\u30bb\u30b9\u3067\u304d\u308bWeb\u30a2\u30d7\u30ea\u30b1\u30fc\u30b7\u30e7\u30f3\u3067\u3059\u3002 \u305d\u308c\u3089\u306f\u3001\u5b8c\u5168\u306a\u30a2\u30d7\u30ea\u30b1\u30fc\u30b7\u30e7\u30f3\uff08I2PSNARK\u306a\u3069\uff09\u3001\u5225\u306e\u30af\u30e9\u30a4\u30a2\u30f3\u30c8\u307e\u305f\u306f\u5225\u306e\u30af\u30e9\u30a4\u30a2\u30f3\u30c8\u3078\u306e\u30d5\u30ed\u30f3\u30c8\u30a8\u30f3\u30c9\uff08susidns\u3001i2ptunnel\u306a\u3069\uff09\u3001\u307e\u305f\u306fWeb\u30a4\u30f3\u30bf\u30fc\u30d5\u30a7\u30a4\u30b9\u304c\u307e\u3063\u305f\u304f\u306a\u3044\uff08\u4f8b\uff1a\u30a2\u30c9\u30ec\u30b9\u30d6\u30c3\u30af\uff09\u3067\u3042\u308b\u5834\u5408\u304c\u3042\u308a\u307e\u3059\u3002";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
    t[2961] = "\u8b66\u544a - \u53d7\u4fe1 0 \u30db\u30c3\u30d7 \u30c8\u30f3\u30cd\u30eb\u306f\u3001\u96a0\u3057\u30eb\u30fc\u30bf\u30fc\u306b\u306f\u63a8\u5968\u3055\u308c\u307e\u305b\u3093\u3002";
    t[2972] = "HTTP Proxy";
    t[2973] = "HTTP \u30d7\u30ed\u30ad\u30b7";
    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
