    t[3557] = "\u4fdd\u5b58\u3055\u308c\u305f\u5206\u6790\u306f\u3042\u308a\u307e\u305b\u3093";
    t[3560] = "To update with unsigned I2P+ release builds: <code>http://skank.i2p/i2pupdate.zip</code> or for the latest unsigned development builds: <code>http://skank.i2p/dev/i2pupdate.zip</code>";
    t[3561] = "\u672a\u7f72\u540d\u306e I2P \u30ea\u30ea\u30fc\u30b9 \u30d3\u30eb\u30c9\u3067\u66f4\u65b0\u3059\u308b\u306b\u306f: <code>http://skank.i2p/i2pupdate.zip</code>\u3001\u307e\u305f\u306f\u6700\u65b0\u306e\u672a\u7f72\u540d\u958b\u767a\u30d3\u30eb\u30c9\u306e\u5834\u5408: <code>http://skank.i2p/dev/i2pupdate</code>";
    t[3564] = "Invalid form submission, probably because you used the 'back' or 'reload' button on your browser. Please resubmit.";
    t[3565] = "\u7121\u52b9\u306a\u30d5\u30a9\u30fc\u30e0\u304b\u3089\u306e\u9001\u4fe1\u3001\u304a\u305d\u3089\u304f\u30d6\u30e9\u30a6\u30b6\u3067\u300c\u623b\u308b\u300d\u304b\u300c\u30ea\u30ed\u30fc\u30c9\u300d\u30dc\u30bf\u30f3\u3092\u4f7f\u7528\u3057\u305f\u305f\u3081\u3067\u3059\u3002\u518d\u9001\u4fe1\u3057\u3066\u304f\u3060\u3055\u3044\u3002";
    t[3566] = "Restart Status";
    t[3567] = "\u518d\u8d77\u52d5\u30b9\u30c6\u30fc\u30bf\u30b9";
    t[3568] = "IPv6 Configuration";
    t[3569] = "IPv6\u8a2d\u5b9a";
    t[3578] = "Peak throughput (bytes per second) over a 1 minute period that the peer has sustained in a single tunnel.";
    t[3579] = "\u5358\u4e00\u30c8\u30f3\u30cd\u30eb\u5185\u3067\u30d4\u30a2\u304c\u7dad\u6301\u3057\u305f 1 \u5206\u9593\u306e\u30d4\u30fc\u30af \u30b9\u30eb\u30fc\u30d7\u30c3\u30c8 (1 \u79d2\u3042\u305f\u308a\u306e\u30d0\u30a4\u30c8\u6570)\u3002";
    t[3582] = "Known high capacity peers";
    t[3583] = "\u65e2\u77e5\u306e\u5927\u5bb9\u91cf\u30d4\u30a2";
    t[3586] = "Proxy to connect to I2P's anonymized IRC chat network";
    t[3587] = "I2P\u306e\u533f\u540d\u5316\u3055\u308c\u305fIRC\u30c1\u30e3\u30c3\u30c8\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u306b\u63a5\u7d9a\u3059\u308b\u305f\u3081\u306e\u30d7\u30ed\u30ad\u30b7";
    t[3588] = "After reporting, please restart your router";
    t[3589] = "\u5831\u544a\u5f8c\u3001\u30eb\u30fc\u30bf\u30fc\u3092\u518d\u8d77\u52d5\u3057\u3066\u304f\u3060\u3055\u3044";
    t[3598] = "No longer be a member of the family {0}.";
    t[3599] = "\u3082\u3046\u5bb6\u65cf {0} \u306e\u4e00\u54e1\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3002";
    t[3600] = "No password entered";
    t[3601] = "\u30d1\u30b9\u30ef\u30fc\u30c9\u304c\u5165\u529b\u3055\u308c\u3066\u3044\u307e\u305b\u3093";
    t[3604] = "Enabling this mode will prevent participating traffic";
    t[3605] = "\u3053\u306e\u30e2\u30fc\u30c9\u3092\u6709\u52b9\u306b\u3059\u308b\u3068\u3001\u30c8\u30e9\u30d5\u30a3\u30c3\u30af\u306e\u53c2\u52a0\u304c\u9632\u6b62\u3055\u308c\u307e\u3059";
    t[3618] = "ERR - Clock Skew";
    t[3619] = "ERR - \u30af\u30ed\u30c3\u30af\u30b9\u30ad\u30e5\u30fc";
    t[3624] = "This setting determines whether or not the router should use the provided <i>blocklist.txt</i> file and any user configured blocklists to enable banning of routers by hash or ip address. Ranges and net masks are supported for IPv4 but not IPv6. See the <i>blocklist.txt</i> in your I2P+ application directory for more info. [Enabled by default, restart required]";
    t[3625] = "\u3053\u306e\u8a2d\u5b9a\u306f\u3001\u30eb\u30fc\u30bf\u30fc\u304c\u63d0\u4f9b\u3055\u308c\u305f<i>blocklist.txt</i>\u30d5\u30a1\u30a4\u30eb\u3068\u30e6\u30fc\u30b6\u30fc\u304c\u8a2d\u5b9a\u3057\u305f\u30d6\u30ed\u30c3\u30af\u30ea\u30b9\u30c8\u3092\u4f7f\u7528\u3057\u3066\u3001\u30cf\u30c3\u30b7\u30e5\u307e\u305f\u306fIP\u30a2\u30c9\u30ec\u30b9\u306b\u3088\u308b\u30eb\u30fc\u30bf\u30fc\u306e\u7981\u6b62\u3092\u6709\u52b9\u306b\u3059\u308b\u304b\u3069\u3046\u304b\u3092\u6c7a\u5b9a\u3057\u307e\u3059\u3002IPv4\u3067\u306f\u7bc4\u56f2\u3084\u30cd\u30c3\u30c8\u30de\u30b9\u30af\u304c\u30b5\u30dd\u30fc\u30c8\u3055\u308c\u3066\u3044\u307e\u3059\u304c\u3001IPv6\u3067\u306f\u30b5\u30dd\u30fc\u30c8\u3055\u308c\u3066\u3044\u307e\u305b\u3093\u3002\u8a73\u7d30\u306b\u3064\u3044\u3066\u306f\u3001I2P+\u30a2\u30d7\u30ea\u30b1\u30fc\u30b7\u30e7\u30f3\u30c7\u30a3\u30ec\u30af\u30c8\u30ea\u306e<i>blocklist.txt</i>\u3092\u53c2\u7167\u3057\u3066\u304f\u3060\u3055\u3044\u3002[\u30c7\u30d5\u30a9\u30eb\u30c8\u3067\u6709\u52b9\u3001\u518d\u8d77\u52d5\u304c\u5fc5\u8981]";
    t[3626] = "Licensing and copyright notices";
    t[3627] = "\u30e9\u30a4\u30bb\u30f3\u30b9\u304a\u3088\u3073\u8457\u4f5c\u6a29\u8868\u793a";
    t[3634] = "Official I2P Source Repository";
    t[3635] = "\u516c\u5f0f I2P \u30bd\u30fc\u30b9 \u30ea\u30dd\u30b8\u30c8\u30ea";
    t[3638] = "Outbound UDP on port 123, allowing replies: this is necessary for I2P's internal time sync (via SNTP - querying a random SNTP host in <code>pool.ntp.org</code> or <a href=/help/advancedsettings#ntpserverconfig>another server you specify</a>).";
    t[3639] = "\u5fdc\u7b54\u3092\u8a31\u53ef\u3059\u308b\u30dd\u30fc\u30c8123\u304b\u3089\u306e\u30a2\u30a6\u30c8\u30d0\u30a6\u30f3\u30c9UDP\uff1a\u3053\u308c\u306fI2P\u306e\u5185\u90e8\u6642\u523b\u540c\u671f\u306b\u5fc5\u8981\u3067\u3059\uff08SNTP\u7d4c\u7531 - <code>pool.ntp.org</code>\u306e\u30e9\u30f3\u30c0\u30e0\u306aSNTP\u30db\u30b9\u30c8\u3092\u30af\u30a8\u30ea\u3059\u308b\u304b\u3001<a href=/help/advancedsettings#ntpserverconfig>\u6307\u5b9a\u3057\u305f\u4ed6\u306e\u30b5\u30fc\u30d0\u30fc</a>\uff09\u3002";
    t[3646] = "NetDb Search";
