    t[3938] = "Sort by packets sent";
    t[3939] = "\u9001\u4fe1\u30d1\u30b1\u30c3\u30c8\u3067\u30bd\u30fc\u30c8";
    t[3940] = "Move to bottom";
    t[3941] = "\u4e0b\u90e8\u306b\u79fb\u52d5";
    t[3944] = "Router Information (advanced)";
    t[3945] = "\u30eb\u30fc\u30bf\u30fc\u60c5\u5831(\u8a73\u7d30)";
    t[3950] = "Maximum transmission unit";
    t[3951] = "\u6700\u5927\u9001\u4fe1\u30e6\u30cb\u30c3\u30c8";
    t[3954] = "NTCP [IPv6] &amp; SSU";
    t[3955] = "NTCP [IPv6] &amp; SSU";
    t[3958] = "I2P requires your computer's time be accurate.";
    t[3959] = "I2P \u3067\u306f\u3001\u30b3\u30f3\u30d4\u30e5\u30fc\u30bf\u306e\u6642\u9593\u304c\u6b63\u78ba\u3067\u3042\u308b\u5fc5\u8981\u304c\u3042\u308a\u307e\u3059\u3002";
    t[3960] = "Just finished jobs";
    t[3961] = "\u305f\u3063\u305f\u4eca\u30b8\u30e7\u30d6\u304c\u7d42\u4e86\u3057\u307e\u3057\u305f";
    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "\u4e00\u90e8\u306eIRC\u30af\u30e9\u30a4\u30a2\u30f3\u30c8\u306f\u3001\u4e00\u5b9a\u6642\u9593\u30b5\u30fc\u30d0\u30fc\u3068\u306e\u901a\u4fe1\u304c\u306a\u3044\u5834\u5408\u306b\u30b5\u30fc\u30d0\u30fc\u304b\u3089\u5207\u65ad\u3059\u308b\u3088\u3046\u306b\u8a2d\u5b9a\u3055\u308c\u3066\u3044\u307e\u3059\u3002\u3053\u308c\u306fI2P IRC\u306b\u3068\u3063\u3066\u554f\u984c\u3068\u306a\u308b\u3053\u3068\u304c\u3042\u308a\u307e\u3059\u3002ping\u30bf\u30a4\u30e0\u30a2\u30a6\u30c8\u306e\u5024\u304c\u975e\u5e38\u306b\u4f4e\u304f\u8a2d\u5b9a\u3055\u308c\u3066\u3044\u308b\u5834\u5408\u306f\u3001\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u3078\u306e\u3088\u308a\u5f37\u529b\u306a\u63a5\u7d9a\u306b\u3064\u306a\u304c\u308b\u3053\u3068\u304c\u3042\u308a\u307e\u3059\u3002hexchat\u3067\u306f\u3001<code>/set net_ping_timeout 320</code>\u3068\u5165\u529b\u3057\u3066\u5024\u3092\u8a2d\u5b9a\u3067\u304d\u307e\u3059\u3002\u3053\u308c\u306b\u3088\u308a\u3001\u5024\u304c<code>hexchat.conf</code>\u30d5\u30a1\u30a4\u30eb\u306b\u66f8\u304d\u8fbc\u307e\u308c\u307e\u3059\u3002";
    t[3964] = "Run at Startup?";
    t[3965] = "\u30b9\u30bf\u30fc\u30c8\u30a2\u30c3\u30d7\u6642\u306b\u8d77\u52d5\uff1f";
    t[3972] = "Never";
    t[3973] = "\u4e8c\u5ea6\u3068\u3057\u306a\u3044";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "\u30b7\u30b9\u30c6\u30e0\u304c\u63a5\u7d9a\u3055\u308c\u3066\u3044\u308b\u516c\u5171\u306eIP\u30a2\u30c9\u30ec\u30b9\u304c\u5909\u66f4\u3055\u308c\u305f\u5834\u5408\u306b\u3001\u81ea\u52d5\u7684\u306b<a href=/confignet#ipchange>\u30aa\u30d7\u30b7\u30e7\u30f3\u306e\u8a2d\u5b9a</a>\u3092\u5909\u66f4\u3057\u3066\u3001<a href=/netdb?r=.>\u30eb\u30fc\u30bf\u30fc\u306e\u8b58\u5225\u5b50</a>\u3068<a href=/confignet#udpconfig>\u5916\u90e8\u30dd\u30fc\u30c8</a>\u3092\u5909\u66f4\u3057\u307e\u3059\u3002\u3053\u308c\u306b\u3088\u308a\u3001IP\u30a2\u30c9\u30ec\u30b9\u304c\u983b\u7e41\u306b\u5909\u66f4\u3055\u308c\u308b\u5834\u5408\u3001\u305f\u3068\u3048\u3070\u30e9\u30c3\u30d7\u30c8\u30c3\u30d7\u3092\u8907\u6570\u306e\u5834\u6240\u3067\u4f7f\u7528\u3057\u3066I2P\u3092\u5b9f\u884c\u3057\u3066\u3044\u308b\u5834\u5408\u306b\u3001\u653b\u6483\u8005\u304c\u30eb\u30fc\u30bf\u30fc\u306e\u8b58\u5225\u5b50\u3068IP\u30a2\u30c9\u30ec\u30b9\u3092\u95a2\u9023\u4ed8\u3051\u308b\u306e\u3092\u9632\u3050\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "\u30eb\u30fc\u30bf\u30fc\u306f\u30a2\u30c9\u30ec\u30b9\u3092\u516c\u958b\u3059\u308b\u3088\u3046\u306b\u69cb\u6210\u3055\u308c\u3066\u3044\u306a\u3044\u305f\u3081\u3001\u53d7\u4fe1\u63a5\u7d9a\u3092\u4e88\u671f\u3057\u307e\u305b\u3093\u3002";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "I2P+\uff08Linux/MacOS\uff09\u306b\u4ed8\u5c5e\u306e\u30b3\u30de\u30f3\u30c9\u30e9\u30a4\u30f3\u30a2\u30d7\u30ea\u30b1\u30fc\u30b7\u30e7\u30f3\u3067\u3001\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u4e0a\u306e\u6307\u5b9a\u3055\u308c\u305fHTTP\u30ea\u30bd\u30fc\u30b9\u306b\u5bfe\u3057\u3066<code>head</code>\u30ea\u30af\u30a8\u30b9\u30c8\u3092\u5b9f\u884c\u3057\u3001\u30ea\u30e2\u30fc\u30c8\u30b5\u30fc\u30d0\u30fc\u304b\u3089\u69d8\u3005\u306a\u5fdc\u7b54\u30d8\u30c3\u30c0\u30fc\u3092\u8fd4\u3057\u307e\u3059\u3002\u30c7\u30d5\u30a9\u30eb\u30c8\u3067\u306f\u3001eephead\u306f<code>127.0.0.1:4444</code>\u4e0a\u306eHTTP\u30d7\u30ed\u30ad\u30b7\u3092\u4f7f\u7528\u3057\u307e\u3059\u3002";
    t[4010] = "NTCP [IPv6] &amp; SSU with Introducers";
    t[4011] = "IPv6 NTCP, SSU, \u30a4\u30f3\u30c8\u30ed\u30c7\u30e5\u30fc\u30b5\u30fc";
    t[4016] = "Console language saved.";
    t[4017] = "\u30b3\u30f3\u30bd\u30fc\u30eb\u8a00\u8a9e\u304c\u4fdd\u5b58\u3055\u308c\u307e\u3057\u305f\u3002";
    t[4022] = "Rebuilding";
    t[4023] = "\u518d\u69cb\u6210\u4e2d";
    t[4024] = "Known";
    t[4025] = "\u65e2\u77e5";
    t[4026] = "This setting permits a custom text prefix to be set for the page title on router console pages, potentially useful when you have multiple consoles open on browser tabs and want an easy method to differentiate between them.";
    t[4027] = "\u3053\u306e\u8a2d\u5b9a\u306b\u3088\u308a\u3001\u30eb\u30fc\u30bf\u30fc\u306e\u30b3\u30f3\u30bd\u30fc\u30eb\u30da\u30fc\u30b8\u306e\u30da\u30fc\u30b8\u30bf\u30a4\u30c8\u30eb\u306b\u30ab\u30b9\u30bf\u30e0\u30c6\u30ad\u30b9\u30c8\u30d7\u30ec\u30d5\u30a3\u30c3\u30af\u30b9\u3092\u8a2d\u5b9a\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u30d6\u30e9\u30a6\u30b6\u306e\u30bf\u30d6\u3067\u8907\u6570\u306e\u30b3\u30f3\u30bd\u30fc\u30eb\u3092\u958b\u3044\u3066\u3044\u308b\u5834\u5408\u3001\u305d\u308c\u3089\u3092\u7c21\u5358\u306b\u533a\u5225\u3059\u308b\u305f\u3081\u306b\u5f79\u7acb\u3061\u307e\u3059\u3002";
    t[4034] = "Please enter a search query";
