    t[4043] = "\u5e2f\u57df\u5e45\u30c6\u30b9\u30c8\u4e2d";
    t[4046] = "Receive on";
    t[4047] = "\u53d7\u4fe1\u6642\u9593:";
    t[4048] = "I2P Router Console (Web interface)";
    t[4049] = "I2P\u30eb\u30fc\u30bf\u30fc\u30b3\u30f3\u30bd\u30fc\u30eb\uff08Web\u30a4\u30f3\u30bf\u30fc\u30d5\u30a7\u30fc\u30b9\uff09";
    t[4050] = "Launch console at startup";
    t[4051] = "\u8d77\u52d5\u6642\u306b\u30b3\u30f3\u30bd\u30fc\u30eb\u3092\u8d77\u52d5\u3059\u308b";
    t[4052] = "Job Statistics (excluding single-shot jobs)";
    t[4053] = "\u30b8\u30e7\u30d6\u7d71\u8a08\uff08\u5358\u767a\u30b8\u30e7\u30d6\u3092\u9664\u304f\uff09";
    t[4054] = "In order to access websites hosted on the I2P network, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P+ <b>HTTP</b> proxy, by default running on <code>127.0.0.1 port 4444</code>. For more help, see <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>the configuration guide</a>, or <a href=/help/configuration#browserconfig>the mini-tutorial for Firefox</a>.";
    t[4055] = "I2P\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u3067\u30db\u30b9\u30c8\u3055\u308c\u3066\u3044\u308b\u30a6\u30a7\u30d6\u30b5\u30a4\u30c8\u306b\u30a2\u30af\u30bb\u30b9\u3059\u308b\u305f\u3081\u3001\u307e\u305f\u306f\u30aa\u30d7\u30b7\u30e7\u30f3\u3067\u30c7\u30d5\u30a9\u30eb\u30c8\u306e\u30a2\u30a6\u30c8\u30d7\u30ed\u30ad\u30b7\u3092\u4f7f\u7528\u3057\u3066\u30af\u30ea\u30a2\u30cd\u30c3\u30c8\u4e0a\u306e\u30a6\u30a7\u30d6\u30b5\u30a4\u30c8\u306b\u63a5\u7d9a\u3059\u308b\u305f\u3081\u306b\u3001\u30d6\u30e9\u30a6\u30b6\u3092I2P+ <b>HTTP</b>\u30d7\u30ed\u30ad\u30b7\u306b\u8a2d\u5b9a\u3059\u308b\u5fc5\u8981\u304c\u3042\u308a\u307e\u3059\u3002 \u30c7\u30d5\u30a9\u30eb\u30c8\u3067\u306f<code>127.0.0.1\u30dd\u30fc\u30c84444</code>\u3067\u5b9f\u884c\u3055\u308c\u307e\u3059\u3002 \u8a73\u3057\u3044\u30d8\u30eb\u30d7\u306f\u3001<a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>\u8a2d\u5b9a\u30ac\u30a4\u30c9</a>\u3092\u53c2\u7167\u3059\u308b\u304b\u3001Firefox\u306e<a href=/help/configuration#browserconfig>\u30df\u30cb\u30c1\u30e5\u30fc\u30c8\u30ea\u30a2\u30eb</a>\u3092\u3054\u89a7\u304f\u3060\u3055\u3044\u3002";
    t[4056] = "Postman's Tracker";
    t[4057] = "\u90f5\u4fbf\u914d\u9054\u54e1\u306e\u8ffd\u8de1\u8005";
    t[4058] = "Number of sent messages awaiting acknowledgement";
    t[4059] = "\u78ba\u8a8d\u3092\u5f85\u3063\u3066\u3044\u308b\u9001\u4fe1\u30e1\u30c3\u30bb\u30fc\u30b8\u306e\u6570";
    t[4060] = "Use all auto-detect methods";
    t[4061] = "\u5168\u3066\u306e\u81ea\u52d5\u691c\u51fa\u65b9\u6cd5\u3092\u8a66\u3059";
    t[4062] = "Updating refresh frequency to {0}";
    t[4063] = "\u66f4\u65b0\u983b\u5ea6\u3092 {0} \u306b\u66f4\u65b0\u4e2d";
    t[4066] = "The number of participating tunnels you route for others, divided by the total number of hops in all your exploratory and client tunnels. A number greater than 1.00 means you are contributing more tunnels to the network than you are using.";
    t[4067] = "\u4ed6\u306e\u4eba\u306e\u305f\u3081\u306b\u30eb\u30fc\u30c6\u30a3\u30f3\u30b0\u3059\u308b\u53c2\u52a0\u30c8\u30f3\u30cd\u30eb\u306e\u6570\u3092\u3001\u3059\u3079\u3066\u306e\u63a2\u7d22\u7684\u304a\u3088\u3073\u30af\u30e9\u30a4\u30a2\u30f3\u30c8\u30c8\u30f3\u30cd\u30eb\u306e\u30db\u30c3\u30d7\u306e\u7dcf\u6570\u3067\u5272\u3063\u3066\u3044\u307e\u3059\u3002 1.00\u3092\u8d85\u3048\u308b\u6570\u306f\u3001\u4f7f\u7528\u3057\u3066\u3044\u308b\u3088\u308a\u3082\u591a\u304f\u306e\u30c8\u30f3\u30cd\u30eb\u3092\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u306b\u5bc4\u4e0e\u3057\u3066\u3044\u308b\u3053\u3068\u3092\u610f\u5473\u3057\u307e\u3059\u3002";
    t[4068] = "View router workload and stats";
    t[4069] = "\u30eb\u30fc\u30bf\u30fc\u306e\u30ef\u30fc\u30af\u30ed\u30fc\u30c9\u3068\u7d71\u8a08\u3092\u8868\u793a\u3059\u308b";
    t[4072] = "Error deleting plugin {0}";
    t[4073] = "\u30d7\u30e9\u30b0\u30a4\u30f3 {0} \u3092\u524a\u9664\u3059\u308b\u969b\u306b\u30a8\u30e9\u30fc";
    t[4074] = "Academic commentary and essays";
    t[4075] = "\u30a2\u30ab\u30c7\u30df\u30c3\u30af\u306a\u89e3\u8aac\u3068\u30a8\u30c3\u30bb\u30a4";
    t[4092] = "Updating update URLs.";
    t[4093] = "\u30a2\u30c3\u30d7\u30c7\u30fc\u30c8 URL \u3092\u66f4\u65b0\u4e2d\u3002";
    t[4094] = "Rekey and Restart";
    t[4095] = "\u30ad\u30fc\u4ea4\u63db\u3057\u3066\u518d\u8d77\u52d5";
    t[4096] = "Last Good Lookup";
    t[4097] = "\u6700\u7d42\u826f\u597d\u691c\u7d22";
    t[4098] = "After restarting, you may export the family key.";
    t[4099] = "\u518d\u8d77\u52d5\u5f8c\u3001\u30d5\u30a1\u30df\u30ea\u30fc\u30ad\u30fc\u3092\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u3067\u304d\u307e\u3059\u3002";
    t[4104] = "Router is currently hosting the configured maximum number of transit tunnels";
    t[4105] = "\u30eb\u30fc\u30bf\u30fc\u306f\u73fe\u5728\u3001\u8a2d\u5b9a\u3055\u308c\u305f\u6700\u5927\u30c8\u30e9\u30f3\u30b8\u30c3\u30c8\u30c8\u30f3\u30cd\u30eb\u6570\u3092\u30db\u30b9\u30c8\u3057\u3066\u3044\u307e\u3059";
    t[4106] = "Please supply a valid plugin file";
    t[4107] = "\u6709\u52b9\u306a\u30d7\u30e9\u30b0\u30a4\u30f3 \u30d5\u30a1\u30a4\u30eb\u3092\u63d0\u4f9b\u3057\u3066\u304f\u3060\u3055\u3044";
    t[4122] = "Same IPv4 /16 as us";
    t[4123] = "\u79c1\u305f\u3061\u3068\u540c\u3058IPv4/16";
    t[4126] = "Updating after restart";
    t[4127] = "\u518d\u8d77\u52d5\u5f8c\u306e\u30a2\u30c3\u30d7\u30c7\u30fc\u30c8";
    t[4130] = "I2P+ will now test your internet connection to identify the optimal speed settings.";
    t[4131] = "I2P \u306f\u30a4\u30f3\u30bf\u30fc\u30cd\u30c3\u30c8\u63a5\u7d9a\u3092\u30c6\u30b9\u30c8\u3057\u3066\u3001\u6700\u9069\u306a\u901f\u5ea6\u8a2d\u5b9a\u3092\u7279\u5b9a\u3057\u307e\u3059\u3002";
    t[4136] = "To change client options, edit the file: {0}";
    t[4137] = "\u30af\u30e9\u30a4\u30a2\u30f3\u30c8 \u30aa\u30d7\u30b7\u30e7\u30f3\u3092\u5909\u66f4\u3059\u308b\u306b\u306f\u3001\u30d5\u30a1\u30a4\u30eb {0} \u3092\u7de8\u96c6\u3057\u307e\u3059\u3002";
    t[4138] = "Installed I2P+ system service";
    t[4139] = "I2P\u30b7\u30b9\u30c6\u30e0\u30b5\u30fc\u30d3\u30b9\u3092\u30a4\u30f3\u30b9\u30c8\u30fc\u30eb";
    t[4142] = "An address containing an encrypted LeaseSet is informally referred to as a b33 address, an extension of a base32 address with the host's public key and signature type encoded into the address instead of a lookup hash. This address type is required for blinded Leasesets. More information: <a href=https://geti2p.net/spec/b32encrypted class='sitelink external' target=_blank rel=noreferrer>B33 Specification</a>";
    t[4143] = "\u6697\u53f7\u5316\u3055\u308c\u305fLeaseSet\u3092\u542b\u3080\u30a2\u30c9\u30ec\u30b9\u3092\u975e\u516c\u5f0f\u306bb33\u30a2\u30c9\u30ec\u30b9\u3068\u547c\u3073\u307e\u3059\u3002\u3053\u308c\u306f\u30eb\u30c3\u30af\u30a2\u30c3\u30d7\u30cf\u30c3\u30b7\u30e5\u306e\u4ee3\u308f\u308a\u306b\u30db\u30b9\u30c8\u306e\u516c\u958b\u30ad\u30fc\u3068\u7f72\u540d\u30bf\u30a4\u30d7\u304c\u30a2\u30c9\u30ec\u30b9\u306b\u30a8\u30f3\u30b3\u30fc\u30c9\u3055\u308c\u305f\u3001Base32\u30a2\u30c9\u30ec\u30b9\u306e\u62e1\u5f35\u3067\u3059\u3002\u3053\u306e\u30a2\u30c9\u30ec\u30b9\u30bf\u30a4\u30d7\u306f\u3001\u30d6\u30e9\u30a4\u30f3\u30c9\u3055\u308c\u305fLeaseset\u306b\u5fc5\u8981\u3067\u3059\u3002\u8a73\u7d30\u306b\u3064\u3044\u3066\u306f\u3001<a href=https://geti2p.net/spec/b32encrypted class='sitelink external' target=_blank rel=noreferrer>B33\u4ed5\u69d8</a>\u3092\u53c2\u7167\u3057\u3066\u304f\u3060\u3055\u3044\u3002";
