    t[4689] = "\u691c\u51fa\u3055\u308c\u305f\u30b7\u30d3\u30eb\u3092\u7981\u6b62\u30ea\u30b9\u30c8\u306b\u8ffd\u52a0";
    t[4696] = "Prefer IPv4 over IPv6";
