    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "\u30a4\u30f3\u30d0\u30a6\u30f3\u30c9 TCP \u304c\u6709\u52b9\u306b\u306a\u3063\u3066\u3044\u308b\u30d5\u30a1\u30a4\u30a2\u30a6\u30a9\u30fc\u30eb";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "\u30e2\u30c7\u30e0\u3001\u30eb\u30fc\u30bf\u30fc\u3001\u304a\u3088\u3073/\u307e\u305f\u306f\u30d5\u30a1\u30a4\u30a2\u30a6\u30a9\u30fc\u30eb\u3067<a href=/confignet#udpconfig>I2P+\u306e\u30dd\u30fc\u30c8</a>\u3092\u958b\u304f\u3068\u3001\u3088\u308a\u826f\u3044\u63a5\u7d9a\u304c\u53ef\u80fd\u306b\u306a\u308a\u307e\u3059\uff08\u7406\u60f3\u7684\u306b\u306fUDP\u3068TCP\u306e\u4e21\u65b9\uff09\u3002\u30dd\u30fc\u30c8\u8ee2\u9001\u306e\u65b9\u6cd5\u306b\u3064\u3044\u3066\u306e\u8a73\u7d30\u306f\u3001\u4e0b\u8a18\u306b\u30ea\u30b9\u30c8\u3055\u308c\u3066\u3044\u308b\u30d5\u30a9\u30fc\u30e9\u30e0\u3084IRC\u30c1\u30e3\u30f3\u30cd\u30eb\u306b\u52a0\u3048\u3066\u3001<a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>\u3067\u898b\u3064\u3051\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002I2P\u306fhttp\u3084socks\u30d7\u30ed\u30ad\u30b7\u3092\u4ecb\u3057\u3066\u30a4\u30f3\u30bf\u30fc\u30cd\u30c3\u30c8\u306b\u63a5\u7d9a\u3059\u308b\u3053\u3068\u306f\u30b5\u30dd\u30fc\u30c8\u3057\u3066\u3044\u307e\u305b\u3093[\u30d1\u30c3\u30c1\u6b53\u8fce\uff01]\u304c\u3001\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u306b\u63a5\u7d9a\u3057\u305f\u5f8c\u306fI2P\u81ea\u4f53\u3092\u4ecb\u3057\u3066\u30d7\u30ed\u30ad\u30b7\u306b\u63a5\u7d9a\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u306e\u3067\u3054\u6ce8\u610f\u304f\u3060\u3055\u3044\u3002";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "\u30c8\u30f3\u30cd\u30eb\u30d5\u30a3\u30eb\u30bf\u306f\u3001\u30c8\u30f3\u30cd\u30eb\u30b9\u30ed\u30c3\u30c8\u30e9\u30fc\u3068\u9023\u643a\u3059\u308b\u304b\u3001\u5225\u306e\u6226\u7565\u3068\u3057\u3066\u4f7f\u7528\u3055\u308c\u308b\u3053\u3068\u3067\u3001\u672c\u7269\u306e\u30e6\u30fc\u30b6\u30fc\u306b\u306f\u30b5\u30fc\u30d3\u30b9\u3092\u4e2d\u65ad\u3059\u308b\u3053\u3068\u306a\u304f\u3001\u30b5\u30fc\u30d3\u30b9\u306e\u505c\u6b62\u653b\u6483\u304b\u3089\u4fdd\u8b77\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u307e\u305f\u3001\u30db\u30b9\u30c8\u3055\u308c\u305f\u30b5\u30fc\u30d3\u30b9\u3078\u306e\u30a2\u30af\u30bb\u30b9\u3092\u30ed\u30b0\u306b\u8a18\u9332\u3057\u3001\u30b5\u30fc\u30d0\u30fc\u304c\u653b\u6483\u3092\u53d7\u3051\u3066\u3044\u308b\u304b\u3069\u3046\u304b\u3092\u5224\u5225\u3059\u308b\u305f\u3081\u3001\u307e\u305f\u306fI2P\u306e\u5b9b\u5148\u3054\u3068\u306b\u3059\u3079\u3066\u306e\u8a2a\u554f\u8005\u3092\u30ed\u30b0\u306b\u8a18\u9332\u3059\u308b\u305f\u3081\u306b\u3082\u4f7f\u7528\u3067\u304d\u307e\u3059\u3002\u3055\u3089\u306b\u3001\u30d5\u30a3\u30eb\u30bf\u306f\u30db\u30ef\u30a4\u30c8\u30ea\u30b9\u30c8\u3068\u30d6\u30e9\u30c3\u30af\u30ea\u30b9\u30c8\u306e\u4e21\u65b9\u306e\u6a5f\u80fd\u3092\u540c\u6642\u306b\u5099\u3048\u308b\u3053\u3068\u304c\u3067\u304d\u3001Tunnel Manager\u306e\u30a2\u30af\u30bb\u30b9\u30ea\u30b9\u30c8\u30b3\u30f3\u30c8\u30ed\u30fc\u30eb\u3088\u308a\u3082\u67d4\u8edf\u3067\u3059\u3002\u5404\u30b5\u30fc\u30d0\u30fc\u30c8\u30f3\u30cd\u30eb\u304c\u5358\u4e00\u306e\u30d5\u30a3\u30eb\u30bf\u30d5\u30a1\u30a4\u30eb\u3092\u5171\u6709\u3059\u308b\u3053\u3068\u3082\u3067\u304d\u307e\u3059\uff08\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u5168\u4f53\u306e\u30d5\u30a3\u30eb\u30bf\u3092\u5b9f\u88c5\u3059\u308b\u5834\u5408\uff09\u3002";
