    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "I2P\u30d7\u30e9\u30b0\u30a4\u30f3\u3068\u3057\u3066\u5229\u7528\u53ef\u80fd\u306aTor\u30af\u30e9\u30a4\u30a2\u30f3\u30c8\u306eJava\u5b9f\u88c5\u3067\u3059\u3002\u8a72\u5f53\u3059\u308bSOCKS\u307e\u305f\u306fHTTP\u30af\u30e9\u30a4\u30a2\u30f3\u30c8\u30c8\u30f3\u30cd\u30eb\u3067\u8a2d\u5b9a\u3055\u308c\u3066\u3044\u308b\u5834\u5408\u3001\u30c7\u30d5\u30a9\u30eb\u30c8\u306e<i>\u30a2\u30a6\u30c8\u30d7\u30ed\u30ad\u30b7</i>\u3068\u3057\u3066\u4f7f\u7528\u3067\u304d\u307e\u3059\u3002<i>Tunnel Manager</i>\u3067\u5229\u7528\u53ef\u80fd\u3067\u3059\u3002<a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>\u304b\u3089\u30c0\u30a6\u30f3\u30ed\u30fc\u30c9\u53ef\u80fd\u3067\u3059\u3002\u30bd\u30fc\u30b9\u30b3\u30fc\u30c9\u306f<a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>\u3067\u516c\u958b\u3055\u308c\u3066\u3044\u307e\u3059\u3002";
    t[6952] = "IPv4 Addresses";
    t[6953] = "IPv4 \u30a2\u30c9\u30ec\u30b9";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "\u3053\u306e\u30bb\u30af\u30b7\u30e7\u30f3\u306f\u3001\u30bb\u30c3\u30b7\u30e7\u30f3\u306e\u5e73\u5747\u5e2f\u57df\u5e45\u901f\u5ea6\u3068\u7dcf\u4f7f\u7528\u91cf\u3092\u793a\u3057\u307e\u3059\u3002\u3059\u3079\u3066\u306e\u5024\u306f\u30d0\u30a4\u30c8/\u79d2\u3067\u8868\u3055\u308c\u307e\u3059\u3002\u5e2f\u57df\u5e45\u306e\u5236\u9650\u3092<a href='/config'>\u5e2f\u57df\u5e45\u8a2d\u5b9a\u30da\u30fc\u30b8</a>\u3067\u5909\u66f4\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u5229\u7528\u53ef\u80fd\u306a\u5e2f\u57df\u5e45\u304c\u591a\u3044\u307b\u3069\u3001\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u3092\u652f\u63f4\u3057\u3001\u81ea\u8eab\u306e\u533f\u540d\u6027\u3092\u5411\u4e0a\u3055\u305b\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u306e\u3067\u3001\u8a2d\u5b9a\u3092\u78ba\u8a8d\u3059\u308b\u6642\u9593\u3092\u53d6\u3063\u3066\u304f\u3060\u3055\u3044\u3002\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u306e\u901f\u5ea6\u304c\u5206\u304b\u3089\u306a\u3044\u5834\u5408\u306f\u3001<a href='http://speedtest.net/'>SpeedTest</a>\u306a\u3069\u306e\u30b5\u30fc\u30d3\u30b9\u3092\u4f7f\u7528\u3059\u308b\u3068\u3001\u5e2f\u57df\u5e45\u306e\u80fd\u529b\u306e\u826f\u3044\u76ee\u5b89\u304c\u5f97\u3089\u308c\u307e\u3059\u3002\u4e0a\u308a\u5171\u6709\u91cf\uff08KBps Out\uff09\u306f\u3001\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u3078\u306e\u7dcf\u8ca2\u732e\u306b\u5f71\u97ff\u3057\u307e\u3059\u3002\u5e2f\u57df\u5e45\u306f\u30c7\u30d5\u30a9\u30eb\u30c8\u3067<a href='/graphs'>\u30b0\u30e9\u30d5\u5316</a>\u3055\u308c\u307e\u3059\u3002";
