    t[8207] = "\u958b\u59cb";
    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "\u53ef\u80fd\u306a\u9650\u308a\u3001\u30b5\u30a4\u30c8\u3067\u7e70\u308a\u8fd4\u3057\u4f7f\u7528\u3055\u308c\u308b\u30a2\u30bb\u30c3\u30c8\u306f\u3001\u30a4\u30f3\u30e9\u30a4\u30f3\u3067\u306f\u306a\u304f\u5916\u90e8\u30d5\u30a1\u30a4\u30eb\u304b\u3089\u30ed\u30fc\u30c9\u3059\u308b\u5fc5\u8981\u304c\u3042\u308a\u307e\u3059\u3002\u8907\u6570\u306e\u30da\u30fc\u30b8\u3067\u540c\u3058CSS\u3092\u4f7f\u7528\u3057\u3066\u3044\u308b\u5834\u5408\u306f\u3001\u72ec\u7acb\u3057\u305fCSS\u30d5\u30a1\u30a4\u30eb\u3092\u4f5c\u6210\u3057\u3001\u30da\u30fc\u30b8\u306e<head>\u30bb\u30af\u30b7\u30e7\u30f3\u3067\u305d\u308c\u3092\u30ed\u30fc\u30c9\u3057\u307e\u3059\u3002\u3053\u308c\u306b\u3088\u308a\u3001\u30b5\u30a4\u30c8\u306e\u30b9\u30bf\u30a4\u30eb\u306e\u66f4\u65b0\u304c\u7c21\u5358\u306b\u306a\u308a\u3001\u30d5\u30a1\u30a4\u30eb\u3092\u8a2a\u554f\u8005\u306e\u30d6\u30e9\u30a6\u30b6\u3067\u30ad\u30e3\u30c3\u30b7\u30e5\u3059\u308b\u3053\u3068\u3082\u53ef\u80fd\u306b\u306a\u308a\u307e\u3059\u3002\u3053\u308c\u306b\u3088\u308a\u3001Web\u30b5\u30fc\u30d0\u30fc\u3078\u306e\u5e2f\u57df\u5e45\u8981\u6c42\u304c\u5c11\u306a\u304f\u306a\u308a\u3001\u8a2a\u554f\u8005\u306e\u30da\u30fc\u30b8\u8aad\u307f\u8fbc\u307f\u304c\u9ad8\u901f\u5316\u3055\u308c\u307e\u3059\u3002";
