    t[8252] = "Help Section";
    t[8253] = "\u30d8\u30eb\u30d7\u30bb\u30af\u30b7\u30e7\u30f3";
    t[8256] = "Configuring I2P+: Network, Firefox, Tunnel Manager";
    t[8257] = "I2P\u306e\u69cb\u6210\uff1a\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u3001Firefox\u3001\u30c8\u30f3\u30cd\u30eb\u30de\u30cd\u30fc\u30b8\u30e3\u30fc";
    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "\u30d5\u30a1\u30a4\u30a2\u30a6\u30a9\u30fc\u30eb\u3092\u89e3\u9664\u3057\u305f\u3068\u601d\u3063\u3066\u3082\u3001I2P\u304c\u307e\u3060\u30d5\u30a1\u30a4\u30a2\u30a6\u30a9\u30fc\u30eb\u306b\u30d6\u30ed\u30c3\u30af\u3055\u308c\u3066\u3044\u308b\u3068\u5224\u65ad\u3057\u3066\u3044\u308b\u5834\u5408\u3001\u8907\u6570\u306e\u30d5\u30a1\u30a4\u30a2\u30a6\u30a9\u30fc\u30eb\u304c\u3042\u308b\u53ef\u80fd\u6027\u304c\u3042\u308b\u3053\u3068\u3092\u5ff5\u982d\u306b\u7f6e\u3044\u3066\u304a\u3044\u3066\u304f\u3060\u3055\u3044\u3002\u305f\u3068\u3048\u3070\u3001\u30bd\u30d5\u30c8\u30a6\u30a7\u30a2\u30d1\u30c3\u30b1\u30fc\u30b8\u3068\u5916\u90e8\u306e\u30cf\u30fc\u30c9\u30a6\u30a7\u30a2\u30eb\u30fc\u30bf\u30fc\u306e\u4e21\u65b9\u3067\u3059\u3002";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "\u30ad\u30fc\u30ef\u30fc\u30c9<i class=example>deny</i>\u3002\u3053\u306e\u95be\u5024\u306f\u5e38\u306b\u9055\u53cd\u3057\u3001\u63a5\u7d9a\u8a66\u884c\u306f\u8a31\u53ef\u3055\u308c\u307e\u305b\u3093\u3002";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "1 \u5206\u9593\u306b 90 \u4ee5\u4e0a\u306e\u63a5\u7d9a\u3092\u884c\u3046\u8a2a\u554f\u8005\u306e\u30ed\u30b0";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "\u53d7\u4fe1 TCP \u3092\u8a2d\u5b9a\u3057\u307e\u3057\u305f\u304c\u3001UDP \u30dd\u30fc\u30c8\u304c\u30d5\u30a1\u30a4\u30a2\u30a6\u30a9\u30fc\u30eb\u3067\u4fdd\u8b77\u3055\u308c\u3066\u3044\u308b\u305f\u3081\u3001TCP \u30dd\u30fc\u30c8\u3082\u30d5\u30a1\u30a4\u30a2\u30a6\u30a9\u30fc\u30eb\u3067\u4fdd\u8b77\u3055\u308c\u3066\u3044\u308b\u53ef\u80fd\u6027\u304c\u3042\u308a\u307e\u3059\u3002";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "\u3053\u308c\u306f\u3001\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u30c7\u30fc\u30bf\u30d9\u30fc\u30b9\u306e\u7167\u4f1a\u306b\u30eb\u30fc\u30bf\u30fc\u304c\u4f7f\u7528\u3059\u308b\u30d4\u30a2\u306e\u6570\u3067\u3059\u3002\u901a\u5e38\u3001\u3053\u308c\u3089\u306f\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u306e\u6574\u5408\u6027\u3092\u7dad\u6301\u3059\u308b\u8cac\u4efb\u3092\u6301\u3064<i>floodfill</i>\u30eb\u30fc\u30bf\u3067\u3059\u3002\u7d71\u5408\u3055\u308c\u305f\u30d4\u30a2\u306f<a href='/profiles'>\u30d7\u30ed\u30d5\u30a1\u30a4\u30eb\u30da\u30fc\u30b8</a>\u306e\u4e0b\u90e8\u306b\u8868\u793a\u3055\u308c\u307e\u3059\u3002";
    t[8298] = "Manage Router webapps";
    t[8299] = "\u30eb\u30fc\u30bf\u30fc Web \u30a2\u30d7\u30ea\u306e\u7ba1\u7406";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "\u30e9\u30f3\u30c0\u30e0\u306a\u30cf\u30a4\u30dd\u30fc\u30c8\u304b\u3089\u4efb\u610f\u306e\u30ea\u30e2\u30fc\u30c8TCP\u30dd\u30fc\u30c8\u3078\u306e\u30a2\u30a6\u30c8\u30d0\u30a6\u30f3\u30c9TCP\u3002";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "I2P \u3092\u958b\u59cb\u3059\u308b\u3068\u3001\u30eb\u30fc\u30bf\u30fc\u3092\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u306b\u30d6\u30fc\u30c8\u30b9\u30c8\u30e9\u30c3\u30d7 (\u7d71\u5408) \u3057\u3001\u8ffd\u52a0\u306e\u30d4\u30a2\u3092\u691c\u7d22\u3059\u308b\u306e\u306b\u6570\u5206\u304b\u304b\u308b\u3053\u3068\u304c\u3042\u308a\u307e\u3059\u306e\u3067\u3001\u3057\u3070\u3089\u304f\u304a\u5f85\u3061\u304f\u3060\u3055\u3044\u3002";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
    t[8319] = "\u30d5\u30a1\u30a4\u30eb\u304c\u6307\u5b9a\u3055\u308c\u3066\u3044\u307e\u305b\u3093\u3002 \u518d\u30b7\u30fc\u30c9\u5143\u306e\u6709\u52b9\u306a .zip \u307e\u305f\u306f .su3 \u30d5\u30a1\u30a4\u30eb\u3092\u9078\u629e\u3057\u3066\u304f\u3060\u3055\u3044\u3002";
    t[8320] = "Enable Universal Plug and Play (UPnP)";
    t[8321] = "\u30e6\u30cb\u30d0\u30fc\u30b5\u30eb\u30d7\u30e9\u30b0\u30a2\u30f3\u30c9\u30d7\u30ec\u30a4\uff08UPnP\uff09\u3092\u6709\u52b9\u306b\u3059\u308b";
    t[8322] = "Unknown Wizard page";
    t[8323] = "\u672a\u77e5\u306e\u30a6\u30a3\u30b6\u30fc\u30c9\u30da\u30fc\u30b8";
    t[8326] = "NTCP &amp; SSU with Introducers [IPv6 Only]";
    t[8327] = "IPv6 \u306e\u307f NTCP, SSU, \u30a4\u30f3\u30c8\u30ed\u30c7\u30e5\u30fc\u30b5\u30fc";
    t[8332] = "Messages sent to peer";
    t[8333] = "\u30d4\u30a2\u306b\u9001\u4fe1\u3055\u308c\u308b\u30e1\u30c3\u30bb\u30fc\u30b8";
    t[8334] = "Function";
    t[8335] = "\u6a5f\u80fd";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "I2P\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u4e0a\u3067\u306f\u3001\u30ea\u30e2\u30fc\u30c8\u30db\u30b9\u30c8\u3055\u308c\u305f\u30b5\u30fc\u30d3\u30b9\u306b\u306f<a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a>\u30a2\u30c9\u30ec\u30b9\u304c\u4f7f\u7528\u3055\u308c\u3001\u300c.b32.i2p\u300d\u3067\u7d42\u308f\u308a\u307e\u3059\u3002\u3053\u308c\u306f\u9577\u3044<a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a>\u6587\u5b57\u5217\u3067\u8868\u3055\u308c\u305f<i>destination</i>\u3001\u307e\u305f\u306f\u4e00\u822c\u7684\u306b\u306f.i2p\u30c9\u30e1\u30a4\u30f3\u3092\u4f7f\u7528\u3057\u307e\u3059\u3002I2P\u306edestination\u306fIP\u30a2\u30c9\u30ec\u30b9\u306b\u76f8\u5f53\u3057\u3001<a href='/i2ptunnel/edit?tunnel=3'>\u30c8\u30f3\u30cd\u30eb\u30de\u30cd\u30fc\u30b8\u30e3\u30fc\u69cb\u6210\u30da\u30fc\u30b8</a>\u3067\u8868\u793a\u3055\u308c\u307e\u3059\u3002\u81ea\u5206\u304c\u72ec\u81ea\u306e.i2p\u30c9\u30e1\u30a4\u30f3\u3092\u767b\u9332\u3059\u308b\u307e\u3067\u3001b32.i2p\u30a2\u30c9\u30ec\u30b9\u3092\u5171\u6709\u3057\u3066\u4ed6\u306e\u4eba\u304c\u30a6\u30a7\u30d6\u30b5\u30a4\u30c8\u306b\u30a2\u30af\u30bb\u30b9\u3067\u304d\u308b\u3088\u3046\u306b\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002";
    t[8340] = "Computing-related tutorials";
    t[8341] = "\u30b3\u30f3\u30d4\u30e5\u30fc\u30c6\u30a3\u30f3\u30b0\u95a2\u9023\u306e\u30c1\u30e5\u30fc\u30c8\u30ea\u30a2\u30eb";
    t[8342] = "Error {0}";
    t[8343] = "\u30a8\u30e9\u30fc{0}";
    t[8350] = "Enter the name and paste the destination into your <a href='/dns?book=router&amp;filter=none'>address book</a>. Click <i>Add</i> to save the new entry.";
    t[8351] = "\u540d\u524d\u3092\u5165\u529b\u3057\u3001\u5b9b\u5148\u3092<a href='/dns?book=router&amp;filter=none'>\u30a2\u30c9\u30ec\u30b9\u30d6\u30c3\u30af</a>\u306b\u8cbc\u308a\u4ed8\u3051\u3066\u304f\u3060\u3055\u3044\u3002<i>\u8ffd\u52a0</i>\u3092\u30af\u30ea\u30c3\u30af\u3057\u3066\u65b0\u3057\u3044\u30a8\u30f3\u30c8\u30ea\u3092\u4fdd\u5b58\u3057\u3066\u304f\u3060\u3055\u3044\u3002";
    t[8358] = "Stats";
    t[8359] = "\u7d71\u8a08";
    t[8360] = "Maximum number of concurrent messages to send";
    t[8361] = "\u540c\u6642\u306b\u9001\u4fe1\u3059\u308b\u30e1\u30c3\u30bb\u30fc\u30b8\u306e\u6700\u5927\u6570";
    t[8364] = "Recorders keep track of connection attempts made by a remote destination, and if that breaches the defined threshold, the destination gets logged in the specified file. Multiple recorders can be specified:";
    t[8365] = "\u30ec\u30b3\u30fc\u30c0\u30fc\u306f\u3001\u30ea\u30e2\u30fc\u30c8\u5b9b\u5148\u306b\u3088\u3063\u3066\u884c\u308f\u308c\u305f\u63a5\u7d9a\u8a66\u884c\u3092\u8ffd\u8de1\u3057\u3001\u305d\u308c\u304c\u5b9a\u7fa9\u3055\u308c\u305f\u3057\u304d\u3044\u5024\u3092\u8d8a\u3048\u305f\u5834\u5408\u3001\u5b9b\u5148\u306f\u6307\u5b9a\u3055\u308c\u305f\u30d5\u30a1\u30a4\u30eb\u306b\u8a18\u9332\u3055\u308c\u307e\u3059\u3002\u8907\u6570\u306e\u30ec\u30b3\u30fc\u30c0\u30fc\u3092\u6307\u5b9a\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002";
    t[8368] = "(the symbol '@' will be replaced during log rotation)";
    t[8369] = "(\u8a18\u53f7\u300c@\u300d\u306f\u30ed\u30b0\u306e\u30ed\u30fc\u30c6\u30fc\u30b7\u30e7\u30f3\u4e2d\u306b\u7f6e\u304d\u63db\u3048\u3089\u308c\u307e\u3059)";
    t[8376] = "Updated settings for all pools.";
    t[8377] = "\u5168\u30d7\u30fc\u30eb\u3067\u8a2d\u5b9a\u304c\u66f4\u65b0\u3055\u308c\u307e\u3057\u305f\u3002";
    t[8382] = "Capabilities in the NetDb, not used to determine profiles";
    t[8383] = "NetDB\u306e\u6a5f\u80fd\u3001\u30d7\u30ed\u30d5\u30a1\u30a4\u30eb\u306e\u6c7a\u5b9a\u306b\u306f\u4f7f\u7528\u3055\u308c\u3066\u3044\u307e\u305b\u3093";
    t[8384] = "Configure peer";
    t[8385] = "\u30d4\u30a2\u306e\u8a2d\u5b9a";
    t[8388] = "How long ago connection was established";
    t[8389] = "\u63a5\u7d9a\u304c\u78ba\u7acb\u3055\u308c\u3066\u304b\u3089\u3069\u308c\u304f\u3089\u3044\u7d4c\u3061\u307e\u3059\u304b";
    t[8396] = "Local SSL Certificates";
    t[8397] = "\u30ed\u30fc\u30ab\u30eb\u306eSSL\u8a3c\u660e\u66f8";
    t[8408] = "Delete Sybil Blocklist";
    t[8409] = "Sybil\u30d6\u30ed\u30c3\u30af\u30ea\u30b9\u30c8\u3092\u524a\u9664";
    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "\u30c7\u30a3\u30ec\u30af\u30c8\u30ea\u30ea\u30b9\u30c8\u3092\u7121\u52b9\u306b\u3059\u308b\u306b\u306f\u3001<code>eepsite/contexts</code>\u30d5\u30a9\u30eb\u30c0\u5185\uff08docroot\u30d5\u30a9\u30eb\u30c0\u306e\u76f4\u4e0a\uff09\u306e<code>base-context.xml</code>\u30d5\u30a1\u30a4\u30eb\u3067<code>org.eclipse.jetty.servlet.Default.dirAllowed</code>\u306e\u30a8\u30f3\u30c8\u30ea\u3092\u898b\u3064\u3051\u3001\u305d\u306e\u4e0b\u306b 'true' \u3092 'false' \u306b\u5909\u66f4\u3057\u307e\u3059\u3002\u5909\u66f4\u3092\u5373\u5ea7\u306b\u9069\u7528\u3059\u308b\u306b\u306f\u3001<a href=/configclients>\u30af\u30e9\u30a4\u30a2\u30f3\u30c8\u8a2d\u5b9a\u30da\u30fc\u30b8</a>\u3067<i>I2P Webserver</i>\u30af\u30e9\u30a4\u30a2\u30f3\u30c8\u3092\u505c\u6b62\u3057\u3066\u518d\u8d77\u52d5\u3057\u307e\u3059\u3002\u307e\u305f\u3001\u30c7\u30a3\u30ec\u30af\u30c8\u30ea\u30ea\u30b9\u30c8\u3092\u6291\u5236\u3059\u308b\u305f\u3081\u306b\u3001\u7a7a\u306e<code>index.html</code>\u30d5\u30a1\u30a4\u30eb\u3092\u8868\u793a\u3055\u308c\u308b\u30c7\u30a3\u30ec\u30af\u30c8\u30ea\u306b\u914d\u7f6e\u3059\u308b\u3053\u3068\u3082\u3067\u304d\u307e\u3059\u3002";
