    t[11008] = "Numeric definition of the number of connection attempts in the period specified (in seconds) e.g. <i class=example>15/5</i>, <i class=example>60/60</i> etc.";
    t[11009] = "\u6307\u5b9a\u3055\u308c\u305f\u671f\u9593\uff08\u79d2\u5358\u4f4d\uff09\u3067\u306e\u63a5\u7d9a\u8a66\u884c\u56de\u6570\u306e\u6570\u5024\u7684\u306a\u5b9a\u7fa9\u3001\u4f8b\uff1a<i class=example>15/5</i>, <i class=example>60/60</i> \u306a\u3069";
    t[11018] = "32bit host OS running with less than 4 detected cores";
    t[11019] = "4\u3064\u672a\u6e80\u306e\u691c\u51fa\u3055\u308c\u305f\u30b3\u30a2\u3092\u5099\u3048\u305f32\u30d3\u30c3\u30c8\u30db\u30b9\u30c8OS";
    t[11020] = "Cannot copy plugin to directory {0}";
    t[11021] = "\u30c7\u30a3\u30ec\u30af\u30c8\u30ea {0} \u306b\u30d7\u30e9\u30b0\u30a4\u30f3\u3092\u30b3\u30d4\u30fc\u3067\u304d\u307e\u305b\u3093";
    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "\u30c7\u30d5\u30a9\u30eb\u30c8\u3067\u306f\u3001I2P\u306f\u8d77\u52d5\u6642\u306b\u30b7\u30b9\u30c6\u30e0\u3067\u8a2d\u5b9a\u3055\u308c\u305f\u30c7\u30d5\u30a9\u30eb\u30c8\u306e\u30d6\u30e9\u30a6\u30b6\u3092\u4f7f\u7528\u3057\u307e\u3059\u3002\u4ee3\u66ff\u306e\u30d6\u30e9\u30a6\u30b6\u3092\u6307\u5b9a\u3059\u308b\u5834\u5408\u306f\u3001router.config\u30d5\u30a1\u30a4\u30eb\uff08\u307e\u305f\u306f\u8a73\u7d30\u306a\u30b3\u30f3\u30bd\u30fc\u30eb\u30e2\u30fc\u30c9\u3092\u6709\u52b9\u306b\u3057\u3066\u3044\u308b\u5834\u5408\u306f<a href=/configadvanced>\u9ad8\u5ea6\u306a\u8a2d\u5b9a\u30da\u30fc\u30b8</a>\uff09\u3092\u7de8\u96c6\u3057\u3001\u65b0\u3057\u3044\u8a2d\u5b9a\u884c<code>routerconsole.browser=/path/to/browser</code>\u307e\u305f\u306f<code>routerconsole.browser=\\path\\to\\browser.exe</code>\uff08Windows\u3092\u4f7f\u7528\u3057\u3066\u3044\u308b\u5834\u5408\uff09\u3092\u8ffd\u52a0\u3057\u307e\u3059\u3002\u30c7\u30a3\u30ec\u30af\u30c8\u30ea<code>\\path\\to\\browser</code>\u3092\u4f7f\u7528\u3057\u305f\u3044\u30d6\u30e9\u30a6\u30b6\u306e\u5834\u6240\u306b\u7f6e\u304d\u63db\u3048\u3066\u304f\u3060\u3055\u3044\u3002\u6ce8\u610f\uff1a\u9078\u629e\u3057\u305f\u30d6\u30e9\u30a6\u30b6\u306e\u30d1\u30b9\u306b\u30b9\u30da\u30fc\u30b9\u304c\u542b\u307e\u308c\u3066\u3044\u308b\u5834\u5408\u306f\u3001\u30d1\u30b9\u3092\u5f15\u7528\u7b26\u3067\u56f2\u3080\u5fc5\u8981\u304c\u3042\u308b\u5834\u5408\u304c\u3042\u308a\u307e\u3059\u3002\u4f8b\uff1a<code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
