    t[11113] = "NetDb \u306e {0} \u30d5\u30a1\u30df\u30ea\u306e\u3059\u3079\u3066\u306e\u30e1\u30f3\u30d0\u30fc\u3092\u8868\u793a\u3057\u307e\u3059";
