    t[11124] = "Install from file failed";
    t[11125] = "\u30d5\u30a1\u30a4\u30eb\u304b\u3089\u306e\u30a4\u30f3\u30b9\u30c8\u30fc\u30eb\u5931\u6557";
    t[11128] = "An I2P web application that manages service destinations for the network, mapping B64 hashes to human-readable names. Destinations may be added manually, or via subscriptions to hosts.txt files. Also referred to as SusiDNS. For more information, see the <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[11129] = "\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u306e\u30b5\u30fc\u30d3\u30b9\u5b9b\u5148\u3092\u7ba1\u7406\u3059\u308bI2P\u30a6\u30a7\u30d6\u30a2\u30d7\u30ea\u30b1\u30fc\u30b7\u30e7\u30f3\u3067\u3001B64\u30cf\u30c3\u30b7\u30e5\u3092\u4eba\u9593\u304c\u8aad\u3081\u308b\u540d\u524d\u306b\u30de\u30c3\u30d4\u30f3\u30b0\u3057\u307e\u3059\u3002\u5b9b\u5148\u306f\u624b\u52d5\u3067\u8ffd\u52a0\u3059\u308b\u304b\u3001hosts.txt\u30d5\u30a1\u30a4\u30eb\u3078\u306e\u30b5\u30d6\u30b9\u30af\u30ea\u30d7\u30b7\u30e7\u30f3\u3067\u8ffd\u52a0\u3067\u304d\u307e\u3059\u3002SusiDNS\u3068\u3082\u547c\u3070\u308c\u307e\u3059\u3002\u8a73\u7d30\u306b\u3064\u3044\u3066\u306f\u3001<a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>\u30aa\u30f3\u30e9\u30a4\u30f3\u30c9\u30ad\u30e5\u30e1\u30f3\u30c6\u30fc\u30b7\u30e7\u30f3</a>\u3092\u53c2\u7167\u3057\u3066\u304f\u3060\u3055\u3044\u3002";
    t[11130] = "Events per period";
    t[11131] = "\u30a4\u30d9\u30f3\u30c8\u3068\u671f\u9593";
    t[11134] = "How long before peer gives up resending lost packet";
    t[11135] = "\u30d4\u30a2\u304c\u5931\u308f\u308c\u305f\u30d1\u30b1\u30c3\u30c8\u306e\u518d\u9001\u3092\u8ae6\u3081\u308b\u307e\u3067\u306e\u6642\u9593";
    t[11140] = "Advanced configuration settings";
    t[11141] = "\u9ad8\u5ea6\u306a\u69cb\u6210\u8a2d\u5b9a";
    t[11142] = "Banning will prevent the participation of this peer in tunnels you create.";
    t[11143] = "\u7981\u6b62\u3059\u308b\u3068\u3001\u4f5c\u6210\u3057\u305f\u30c8\u30f3\u30cd\u30eb\u306b\u3053\u306e\u30d4\u30a2\u304c\u53c2\u52a0\u3067\u304d\u306a\u304f\u306a\u308a\u307e\u3059\u3002";
    t[11148] = "UDP Port In Use";
    t[11149] = "UDP\u30dd\u30fc\u30c8\u304c\u4f7f\u7528\u4e2d\u3067\u3059";
    t[11150] = "A tunnel to the main IRC server network within I2P, Irc2P, is created when I2P is installed (see the <a href=/i2ptunnelmgr>Tunnel Manager</a>), and is automatically started when the I2P router starts. To connect to it, tell your IRC client to connect to server: <code>127.0.0.1</code> port: <code>6668</code>.";
    t[11151] = "I2P\u3092\u30a4\u30f3\u30b9\u30c8\u30fc\u30eb\u3059\u308b\u3068\u3001Irc2P\u5185\u306e\u30e1\u30a4\u30f3IRC\u30b5\u30fc\u30d0\u30fc\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u306b\u30c8\u30f3\u30cd\u30eb\u304c\u4f5c\u6210\u3055\u308c\u307e\u3059\uff08\u8a73\u7d30\u306f<a href=/i2ptunnelmgr>\u30c8\u30f3\u30cd\u30eb\u30de\u30cd\u30fc\u30b8\u30e3</a>\u3092\u53c2\u7167\uff09\u3002\u307e\u305f\u3001I2P\u30eb\u30fc\u30bf\u30fc\u304c\u8d77\u52d5\u3059\u308b\u3068\u81ea\u52d5\u7684\u306b\u958b\u59cb\u3055\u308c\u307e\u3059\u3002\u63a5\u7d9a\u3059\u308b\u306b\u306f\u3001IRC\u30af\u30e9\u30a4\u30a2\u30f3\u30c8\u306b\u4ee5\u4e0b\u306e\u30b5\u30fc\u30d0\u30fc\u60c5\u5831\u3092\u6307\u5b9a\u3057\u3066\u304f\u3060\u3055\u3044\uff1a\u30b5\u30fc\u30d0\u30fc\uff1a<code>127.0.0.1</code> \u30dd\u30fc\u30c8\uff1a<code>6668</code>\u3002";
    t[11154] = "LeaseSet Key";
    t[11155] = "\u30ea\u30fc\u30b9\u30bb\u30c3\u30c8\u30ad\u30fc";
    t[11160] = "Clock Skew";
    t[11161] = "\u30af\u30ed\u30c3\u30af\u30b9\u30ad\u30e5\u30fc";
    t[11166] = "UDP Port";
    t[11167] = "UDP\u30dd\u30fc\u30c8";
