    t[11196] = "Destination requires lookup password";
    t[11197] = "\u5b9b\u5148\u306b\u306f\u691c\u7d22\u30d1\u30b9\u30ef\u30fc\u30c9\u304c\u5fc5\u8981\u3067\u3059";
    t[11200] = "Please configure a TCP host and port on the Network Configuration page or enable UDP.";
    t[11201] = "\u300c\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u69cb\u6210\u300d\u30da\u30fc\u30b8\u3067 TCP \u30db\u30b9\u30c8\u3068\u30dd\u30fc\u30c8\u3092\u69cb\u6210\u3059\u308b\u304b\u3001UDP \u3092\u6709\u52b9\u306b\u3057\u3066\u304f\u3060\u3055\u3044\u3002";
    t[11212] = "Outbound Endpoint";
    t[11213] = "\u9001\u4fe1\u30a8\u30f3\u30c9\u30dd\u30a4\u30f3\u30c8";
    t[11216] = "Download and verify only";
    t[11217] = "\u30c0\u30a6\u30f3\u30ed\u30fc\u30c9\u3068\u691c\u8a3c\u306e\u307f";
    t[11218] = "Manual Reseed";
    t[11219] = "\u624b\u52d5\u518d\u30b7\u30fc\u30c9";
    t[11226] = "peers";
    t[11227] = "\u4ef2\u9593";
    t[11230] = "Can be enabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If both http and https are enabled, automatic redirection to https is enabled by default. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[11231] = "<code>clients.config</code>\u30d5\u30a1\u30a4\u30eb\u3067\u6709\u52b9\u306b\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u7279\u5b9a\u306e\u30a4\u30f3\u30bf\u30fc\u30d5\u30a7\u30a4\u30b9\u307e\u305f\u306f\u3059\u3079\u3066\u306e\u30a4\u30f3\u30bf\u30fc\u30d5\u30a7\u30a4\u30b9\u306b\u30d0\u30a4\u30f3\u30c9\u3059\u308b\u3088\u3046\u306b\u3082\u8a2d\u5b9a\u3067\u304d\u307e\u3059\u3002http\u3068https\u306e\u4e21\u65b9\u304c\u6709\u52b9\u306b\u306a\u3063\u3066\u3044\u308b\u5834\u5408\u3001https\u3078\u306e\u81ea\u52d5\u30ea\u30c0\u30a4\u30ec\u30af\u30c8\u304c\u30c7\u30d5\u30a9\u30eb\u30c8\u3067\u6709\u52b9\u306b\u306a\u3063\u3066\u3044\u307e\u3059\u3002\u30eb\u30fc\u30bf\u30fc\u30b3\u30f3\u30bd\u30fc\u30eb\u3092\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u4e0a\u3067\u5229\u7528\u53ef\u80fd\u306b\u3059\u308b\u5834\u5408\u306f\u3001<a href=/configui#passwordheading>\u30a2\u30af\u30bb\u30b9\u30d1\u30b9\u30ef\u30fc\u30c9\u3092\u5f37\u5236</a>\u3057\u3066\u3001\u8a31\u53ef\u3055\u308c\u3066\u3044\u306a\u3044\u30a2\u30af\u30bb\u30b9\u3092\u9632\u6b62\u3059\u308b\u3053\u3068\u3092\u304a\u52e7\u3081\u3057\u307e\u3059\u3002";
    t[11236] = "Tunnel identity";
    t[11237] = "\u30c8\u30f3\u30cd\u30eb\u306e\u30a2\u30a4\u30c7\u30f3\u30c6\u30a3\u30c6\u30a3";
    t[11242] = "Most of the options on the Network Configuration page are for special situations, for example where UPnP does not work correctly, or a firewall not under your control is doing harm.";
    t[11243] = "[\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u69cb\u6210] \u30da\u30fc\u30b8\u306e\u30aa\u30d7\u30b7\u30e7\u30f3\u306e\u307b\u3068\u3093\u3069\u306f\u3001UPnP \u304c\u6b63\u3057\u304f\u52d5\u4f5c\u3057\u306a\u3044\u5834\u5408\u3084\u3001\u5236\u5fa1\u4e0b\u306b\u306a\u3044\u30d5\u30a1\u30a4\u30a2\u30a6\u30a9\u30fc\u30eb\u304c\u5bb3\u3092\u53ca\u307c\u3057\u3066\u3044\u308b\u5834\u5408\u306a\u3069\u3001\u7279\u6b8a\u306a\u72b6\u6cc1\u306b\u5bfe\u5fdc\u3057\u3066\u3044\u307e\u3059\u3002";
    t[11250] = "Filter events";
    t[11251] = "\u30a4\u30d9\u30f3\u30c8\u3092\u30d5\u30a3\u30eb\u30bf\u30fc";
