    t[11983] = "TCP \u30dd\u30fc\u30c8\u304c\u53d7\u4fe1 TCP \u3092\u6709\u52b9\u306b\u3057\u3066\u30d5\u30a1\u30a4\u30a2\u30a6\u30a9\u30fc\u30eb\u3067\u4fdd\u8b77\u3055\u308c\u3066\u3044\u308b\u5834\u5408\u3001\u30eb\u30fc\u30bf\u30fc\u306f TCP \u7d4c\u7531\u3067\u63a5\u7d9a\u3067\u304d\u306a\u304f\u306a\u308a\u3001\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u306b\u640d\u5bb3\u3092\u4e0e\u3048\u307e\u3059\u3002";
    t[11984] = "Local Identity";
    t[11985] = "\u30ed\u30fc\u30ab\u30eb\u30a2\u30a4\u30c7\u30f3\u30c6\u30a3\u30c6\u30a3";
    t[11994] = "While I2P will work fine behind most firewalls, your speeds and network integration will generally improve if the I2P port is forwarded for both UDP and TCP.";
    t[11995] = "I2P \u306f\u307b\u3068\u3093\u3069\u306e\u30d5\u30a1\u30a4\u30a2\u30a6\u30a9\u30fc\u30eb\u306e\u80cc\u5f8c\u3067\u6b63\u5e38\u306b\u52d5\u4f5c\u3057\u307e\u3059\u304c\u3001I2P \u30dd\u30fc\u30c8\u304c UDP \u3068 TCP \u306e\u4e21\u65b9\u306b\u8ee2\u9001\u3055\u308c\u308b\u3068\u3001\u901f\u5ea6\u3068\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u7d71\u5408\u304c\u901a\u5e38\u5411\u4e0a\u3057\u307e\u3059\u3002";
    t[12002] = "Shared Clients";
    t[12003] = "\u5171\u6709\u30af\u30e9\u30a4\u30a2\u30f3\u30c8";
