    t[12007] = "\u30eb\u30fc\u30bf\u30fc\u3001\u30a4\u30f3\u30b9\u30c8\u30fc\u30eb\u3055\u308c\u305f\u30d7\u30e9\u30b0\u30a4\u30f3\u3001\u304a\u3088\u3073\u30eb\u30fc\u30bf\u30fc\u30ed\u30b0\u306e\u8a2d\u5b9a\u30d5\u30a1\u30a4\u30eb\u306f\u3001\u6b21\u306e\u5834\u6240\u306b\u4fdd\u5b58\u3055\u308c\u3066\u3044\u307e\u3059\uff1a";
