    t[12279] = "\u5e38\u306b\u81ea\u52d5\u691c\u51fa\u3055\u308c\u305f IP \u30a2\u30c9\u30ec\u30b9\u3092\u4f7f\u7528\u3057\u307e\u3059 (\u30d5\u30a1\u30a4\u30a2\u30a6\u30a9\u30fc\u30eb\u3067\u306f\u306a\u3044)";
    t[12282] = "where we will store our LS";
    t[12283] = "LS\u3092\u4fdd\u7ba1\u3059\u308b\u5834\u6240";
    t[12284] = "Your Local Identity [{0}] is your unique I2P router identity, similar to an IP address but tailored to I2P. ";
    t[12285] = "\u30ed\u30fc\u30ab\u30eb ID [{0}] \u306f\u3001IP \u30a2\u30c9\u30ec\u30b9\u306b\u4f3c\u3066\u3044\u307e\u3059\u304c\u3001I2P \u306b\u5408\u308f\u305b\u3066\u8abf\u6574\u3055\u308c\u305f\u3001\u72ec\u81ea\u306e I2P \u30eb\u30fc\u30bf\u30fc ID \u3067\u3059\u3002";
    t[12288] = "tunnels";
    t[12289] = "\u30c8\u30f3\u30cd\u30eb";
    t[12290] = "Cancel";
    t[12291] = "\u30ad\u30e3\u30f3\u30bb\u30eb";
    t[12292] = "Last store successful";
    t[12293] = "\u6700\u5f8c\u306e\u30b9\u30c8\u30a2\u306f\u6210\u529f\u3057\u307e\u3057\u305f";
    t[12294] = "Declining transit tunnel requests as we are shutting down";
    t[12295] = "\u30b7\u30e3\u30c3\u30c8\u30c0\u30a6\u30f3\u4e2d\u306e\u305f\u3081\u3001\u53c2\u52a0\u3059\u308b\u30c8\u30f3\u30cd\u30eb\u30ea\u30af\u30a8\u30b9\u30c8\u3092\u62d2\u5426\u3057\u307e\u3059";
    t[12298] = "No name entered";
    t[12299] = "\u540d\u524d\u304c\u5165\u529b\u3055\u308c\u3066\u3044\u307e\u305b\u3093";
    t[12306] = "Your transport connection limits are automatically set based on your configured bandwidth.";
    t[12307] = "\u30c8\u30e9\u30f3\u30b9\u30dd\u30fc\u30c8\u63a5\u7d9a\u5236\u9650\u6570\u306f\u3001\u8a2d\u5b9a\u3055\u308c\u3066\u3044\u308b\u5e2f\u57df\u5e45\u306b\u57fa\u3065\u304d\u81ea\u52d5\u7684\u306b\u8a2d\u5b9a\u3055\u308c\u307e\u3057\u305f\u3002";
    t[12310] = "Move to top";
    t[12311] = "\u4e0a\u90e8\u306b\u79fb\u52d5";
    t[12318] = "A declaration will contain a directive (keyword) with parameters to define the scope of the declaration, and can represent one of the following:";
    t[12319] = "\u5ba3\u8a00\u306b\u306f\u3001\u5ba3\u8a00\u306e\u30b9\u30b3\u30fc\u30d7\u3092\u5b9a\u7fa9\u3059\u308b\u305f\u3081\u306e\u30d1\u30e9\u30e1\u30fc\u30bf\u3092\u6301\u3064\u30c7\u30a3\u30ec\u30af\u30c6\u30a3\u30d6\uff08\u30ad\u30fc\u30ef\u30fc\u30c9\uff09\u304c\u542b\u307e\u308c\u3001\u4ee5\u4e0b\u306e\u3044\u305a\u308c\u304b\u3092\u8868\u3059\u3053\u3068\u304c\u3067\u304d\u307e\u3059:";
    t[12320] = "n/a";
    t[12321] = "n/a";
    t[12330] = "Under <i>Create Reseed File</i> click the <i>Create reseed file</i> button";
    t[12331] = "<i>\u30ea\u30b7\u30fc\u30c9\u30d5\u30a1\u30a4\u30eb\u306e\u4f5c\u6210</i> \u306e\u4e0b\u3067\u3001<i>\u30ea\u30b7\u30fc\u30c9\u30d5\u30a1\u30a4\u30eb\u306e\u4f5c\u6210</i> \u30dc\u30bf\u30f3\u3092\u30af\u30ea\u30c3\u30af\u3057\u3066\u304f\u3060\u3055\u3044";
    t[12342] = "I2P+ Bug Reports";
    t[12343] = "I2P \u30d0\u30b0\u30ec\u30dd\u30fc\u30c8";
    t[12348] = "The unique cryptographic identity of the inbound endpoint of a tunnel providing access to a service on the I2P network, represented as a Base32 or Base64 hash of the public key. Equivalent to an IP address and port.";
    t[12349] = "I2P\u30cd\u30c3\u30c8\u30ef\u30fc\u30af\u4e0a\u306e\u30b5\u30fc\u30d3\u30b9\u306b\u30a2\u30af\u30bb\u30b9\u3059\u308b\u305f\u3081\u306e\u30c8\u30f3\u30cd\u30eb\u306e\u5165\u308a\u53e3\u306e\u30e6\u30cb\u30fc\u30af\u306a\u6697\u53f7\u5316\u8b58\u5225\u5b50\u3067\u3042\u308a\u3001\u516c\u958b\u9375\u306eBase32\u307e\u305f\u306fBase64\u30cf\u30c3\u30b7\u30e5\u3068\u3057\u3066\u8868\u3055\u308c\u307e\u3059\u3002IP\u30a2\u30c9\u30ec\u30b9\u3068\u30dd\u30fc\u30c8\u306b\u76f8\u5f53\u3057\u307e\u3059\u3002";
    t[12352] = "FAQ";
    t[12353] = "\u3088\u304f\u3042\u308b\u8cea\u554f";
    t[12364] = "Out of memory error";
    t[12365] = "\u30a8\u30e9\u30fc\uff1a\u30e1\u30e2\u30ea\u4e0d\u8db3";
    t[12366] = "Plugin from {0} has invalid name or version";
    t[12367] = "{0} \u304b\u3089\u306e\u30d7\u30e9\u30b0\u30a4\u30f3\u306f\u3001\u540d\u524d\u307e\u305f\u306f\u30d0\u30fc\u30b8\u30e7\u30f3\u304c\u7121\u52b9\u3067\u3059";
    t[12368] = "Package/repository installation";
    t[12369] = "\u30d1\u30c3\u30b1\u30fc\u30b8/\u30ea\u30dd\u30b8\u30c8\u30ea\u306e\u30a4\u30f3\u30b9\u30c8\u30fc\u30eb";
    t[12370] = "Certain firewalls such as symmetric NATs may not work well with I2P.";
    t[12371] = "\u5bfe\u79f0 NAT \u306a\u3069\u306e\u7279\u5b9a\u306e\u30d5\u30a1\u30a4\u30a2\u30a6\u30a9\u30fc\u30eb\u306f\u3001I2P \u3067\u306f\u3046\u307e\u304f\u52d5\u4f5c\u3057\u306a\u3044\u53ef\u80fd\u6027\u304c\u3042\u308a\u307e\u3059\u3002";
    t[12374] = "Plugin {0} installed but failed to start, check logs";
    t[12375] = "\u30d7\u30e9\u30b0\u30a4\u30f3 {0} \u304c\u30a4\u30f3\u30b9\u30c8\u30fc\u30eb\u3055\u308c\u307e\u3057\u305f\u304c\u8d77\u52d5\u306b\u5931\u6557\u3001\u30ed\u30b0\u3092\u78ba\u8a8d\u3057\u3066\u304f\u3060\u3055\u3044";
    t[12378] = "Hard restart";
    t[12379] = "\u30cf\u30fc\u30c9\u518d\u8d77\u52d5";
    t[12388] = "Default log level";
    t[12389] = "\u30c7\u30d5\u30a9\u30eb\u30c8\u306e\u30ed\u30b0\u6c34\u6e96";
    t[12398] = "Messages received";
    t[12399] = "\u53d7\u4fe1\u3057\u305f\u30e1\u30c3\u30bb\u30fc\u30b8";
    t[12400] = "Do you have another I2P instance running? Stop the conflicting program and restart I2P.";
    t[12401] = "\u5225\u306e I2P \u306e\u30a4\u30f3\u30b9\u30bf\u30f3\u30b9\u3092\u5b9f\u884c\u3057\u3066\u3044\u307e\u305b\u3093\u304b\uff1f\u7af6\u5408\u3057\u3066\u3044\u308b\u30d7\u30ed\u30b0\u30e9\u30e0\u3092\u505c\u6b62\u3057\u3001 I2P \u3092\u518d\u8d77\u52d5\u3057\u3066\u304f\u3060\u3055\u3044\u3002";
    t[12404] = "The last router in a tunnel, which may be the <i>Outbound Endpoint</i>, where the client's tunnels meet the <i>Inbound Gateway</i> of the destination server's tunnels, or the <i>Inbound Endpoint</i> which is the final router in the chain that connects to the destination server.";
    t[12405] = "\u30c8\u30f3\u30cd\u30eb\u5185\u306e\u6700\u5f8c\u306e\u30eb\u30fc\u30bf\u30fc\u3067\u3001\u30af\u30e9\u30a4\u30a2\u30f3\u30c8\u306e\u30c8\u30f3\u30cd\u30eb\u304c\u5b9b\u5148\u30b5\u30fc\u30d0\u30fc\u306e\u30c8\u30f3\u30cd\u30eb\u306e<i>\u5165\u53e3\u30b2\u30fc\u30c8\u30a6\u30a7\u30a4</i>\u3067\u51fa\u529b\u306e\u30a8\u30f3\u30c9\u30dd\u30a4\u30f3\u30c8\u306b\u63a5\u7d9a\u3055\u308c\u308b\u5834\u6240\u3067\u3042\u308b<i>Outbound Endpoint</i>\u3067\u3042\u308b\u304b\u3001\u76ee\u7684\u5730\u30b5\u30fc\u30d0\u30fc\u306b\u63a5\u7d9a\u3059\u308b\u30c1\u30a7\u30fc\u30f3\u5185\u306e\u6700\u5f8c\u306e\u30eb\u30fc\u30bf\u30fc\u3067\u3042\u308b<i>Inbound Endpoint</i>\u3067\u3042\u308b\u5834\u5408\u304c\u3042\u308a\u307e\u3059\u3002";
    t[12406] = "Attempt to download router reference files (if automatic reseed has failed)";
    t[12407] = "\u30eb\u30fc\u30bf\u30fc\u53c2\u7167\u30d5\u30a1\u30a4\u30eb\u306e\u30c0\u30a6\u30f3\u30ed\u30fc\u30c9\u3092\u8a66\u307f\u307e\u3059(\u81ea\u52d5\u518d\u30b7\u30fc\u30c9\u304c\u5931\u6557\u3057\u305f\u5834\u5408)";
    t[12414] = "Accepting transit tunnel requests; hosting {0} tunnels";
    t[12415] = "\u53c2\u52a0\u30c8\u30f3\u30cd\u30eb\u306e\u30ea\u30af\u30a8\u30b9\u30c8\u3092\u53d7\u3051\u5165\u308c\u308b\u3002 {0}\u30c8\u30f3\u30cd\u30eb\u3078\u306e\u53c2\u52a0";
    t[12424] = "Use HTTP Proxy for HTTP Reseed Hosts";
